numbers that appear in email templates, callouts, templates, etc.',NULL,1,0),(167,1,'2016-01-20 16:47:19','Important: New Security Patch (SUPEE-7405) and Release  1/20/2016','Today, we are releasing a new patch (SUPEE-7405) and Community Edition 1.9.2.3 to improve the security of Magento sites. There are no confirmed attacks related to the security issues, but certain vulnerabilities can potentially be exploited to access customer information or take over administrator sessions. You can download the patch and release from the Community Edition Download Page and learn more at https://magento.com/security/patches/supee-7405. ','https://magento.com/security/patches/supee-7405',1,0),(168,4,'2008-11-07 23:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.',NULL,1,0),(169,4,'2008-11-07 23:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.',NULL,1,0),(170,4,'2008-11-07 23:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.',NULL,1,0),(171,4,'2013-03-12 06:06:04','MageMonkey new version v1.1.1','A new version has been released, change log is.\n- Adding start date for abandoned cart','http://www.magentocommerce.com/magento-connect/mage-monkey-mailchimp-integration-4865.html',1,0),(172,4,'2013-03-20 04:48:26','New MageMonkey version with bug fixes for Abandoned Carts','Release notes are:\n- Fix for abandoned cart multi store management\n- Fix for abandoned cart not send email for a quote who has an order posterior from the same customer','http://www.magentocommerce.com/magento-connect/mage-monkey-mailchimp-integration-4865.html',1,0),(173,4,'2013-07-04 05:19:46','New MageMonkey version, featuring autoresponders','On July 2nd we uploaded version 1.1.12 it includes autoresponders, we hope you enjoy it.','http://www.magentocommerce.com/magento-connect/mage-monkey-mailchimp-integration-4865.html',1,0),(174,4,'2013-03-18 09:37:19','Increase your sales with MageMonkeys free <<RECOVER ABANDONED CARTS>>','Abandoned Cart - is part of the latest version of the MageMonkey Module. It sends an automated email to shoppers who have added your products to their shopping cart, but didn\'t complete the checkout process. This reminder may then encourage the shopper to return and place their order.','http://ebizmarts.com/blog/2013/03/increase-your-sales-with-magemonkeys-free-recover-abandoned-carts',1,0),(175,4,'2008-11-07 23:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.',NULL,1,0),(176,4,'2008-11-07 23:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.',NULL,1,0),(177,4,'2008-11-08 04:46:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.',NULL,1,0),(178,4,'2008-11-08 04:46:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.',NULL,1,0