com/security/patches/supee-7405',1,0),(185,1,'2016-03-31 00:25:07','Protect Your Business from Brute-Force Password Guessing Attacks','We just posted an article on the Magento Security Center that shares best practices for protecting stores from brute-force password guessing attacks. Weve recently been made aware of a rise in these attacks, so we strongly recommend that you review the approaches outlined in this article with your developer and hosting provider immediately and implement the ones that are best suited to your unique situation. Learn more at https://magento.com/security/best-practices/protect-your-magento-installation-password-guessing ','https://magento.com/security/best-practices/protect-your-magento-installation-password-guessing ',1,0),(186,4,'2016-06-23 16:44:34','Increase your sales and productivity, while simplifying PCI compliance with exciting new Magento Community Edition 2.1 features.','Shoppers can now check out faster using credit cards stored with PayPal and a redesigned PayPal checkout. PCI compliance is easier thanks to Braintree Hosted Fields. Admin tools are redesigned to help you work more efficiently. Upgrade to Enterprise Edition for new Content Staging and Preview and Enhanced Site Search capabilities.','https://magento.com/blog/magento-news/magento-enterprise-edition-21-unleashes-power-marketers-and-merchandisers ',0,0),(187,4,'2016-07-15 16:37:35','Magento needs your input. Please take our 2-question survey. Ends on Friday, July 22nd.','We want to hear from you. As a valued Community Edition user, we are interested in learning about your future upgrade plans for your Magento store. The survey is only two questions and should be very quick to complete. We will keep your response completely confidential. Our goal is to understand if and when you plan to upgrade your software, so we can ensure we have the right tools and support to ensure your success. You can access our survey through the following link: https://www.research.net/r/R9R2MJV','https://www.research.net/r/R9R2MJV',0,0);
