INSERT INTO `catalog_product_entity_text` VALUES (175,4,72,0,17,'10 Reasons to live at \"The Shoals\" Lammermoor\r\n\r\n- Because everyone else wants too\r\n\r\n- No body corporate\r\n\r\n- Bigger FLAT easy to build on blocks to make it easier to build your dream home with no hidden building costs\r\n\r\n- Beautiful Lammermoor Beach on your doorstep\r\n\r\n- NBN high speed internet\r\n\r\n- Bigger backyards, longer side boundaries and wider frontages for easier back yard access- lots range from 662m2 to 1200m2 and are priced from $156 500 in stage 1\r\n\r\n- Build the biggest shed that council will allow so you can store all your toys  and perhaps have a man cave!\r\n\r\n- With so many lifestyle choices all within a 4 minute scenic drive of The Shoals, every weekend will feel like its a holiday!\r\n\r\n- 2 schools, The Marina, The Lammermoor Servo and a full line Spa supermarket are also within a 4 minute scenic drive from the Shoals\r\n\r\n- There are many other reasons to live at The Shoals so why dont you take a drive this weekend and have a look for yourself! In fact, if you do, call Ravi now on 0414 47 26 85 and well give you a free coffee voucher or 2 so you can enjoy a coffee at The Waterline Cafe at Keppel Bay Marina!'),(176,4,73,0,17,'10 Reasons to live at \"The Shoals\" Lammermoor\r\n\r\n- Because everyone else wants too\r\n\r\n- No body corporate\r\n\r\n- Bigger FLAT easy to build on blocks to make it easier to build your dream home with no hidden building costs\r\n\r\n- Beautiful Lammermoor Beach on your doorstep\r\n\r\n- NBN high speed internet\r\n\r\n- Bigger backyards, longer side boundaries and wider frontages for easier back yard access- lots range from 662m2 to 1200m2 and are priced from $156 500 in stage 1\r\n\r\n- Build the biggest shed that council will allow so you can store all your toys  and perhaps have a man cave!\r\n\r\n- With so many lifestyle choices all within a 4 minute scenic drive of The Shoals, every weekend will feel like its a hol