elt great! :)------|Some Fantastic 5 Star Reviews!...Rachael Hansen - Expressions of Beauty is a great local business, with friendly, professional staff. They even go above and beyond to accomodate me when I have to bring in my two little girls to appointments. I can recommend De-Ann and her team with absolute enthusiasm. ----------Sarah Munns - Thank you sooo much ladies for mine & the girls beautiful make up, we all loved it & felt great! :)------|1|0|1'),(6642,108,1,'None|10% off Store Wide - Millesime Trejor - Yeppoon|Yeppoon|Some Fantastic 5 Star Reviews!----Sharon McCarrick - Daniel has an amazing store. I dare you to not find something you can\'t live without. His stock and service is out of this world. His shop is just what Yeppoon needed to brighten your home. Daniel is design consultant and will help you design each room in your home. I love love love this store and Daniel--------Deborah Thygesen - Daniel has has given Yeppoon style and class with his amazing shop...x-------------Shelley McArdle - Daniel has brought an eclectic range of beautiful things to our town... Great to see some art pieces created by local artists. Colour and range is amazing along with the servic|Some Fantastic 5 Star Reviews!----Sharon McCarrick - Daniel has an amazing store. I dare you to not find something you can\'t live without. His stock and service is out of this world. His shop is just what Yeppoon needed to brighten your home. Daniel is design consultant and will help you design each room in your home. I love love love this store and Daniel--------Deborah Thygesen - Daniel has has given Yeppoon style and class with his amazing shop...x-------------Shelley McArdle - Daniel has brought an eclectic range of beautiful things to our town... Great to see some art pieces created by local artists. Colour and range is amazing along with the servic|1|0|1'),(6639,101,1,'None|Jane Emery Mobile Hairdresser - Capricorn Coast|Yeppoon|Emu Park/Zilzie|Call me today to discuss this fantasti