INSERT INTO `cms_block` VALUES (1,'Footer Links','footer_links','<div class=\"clsfoot-txt\">\r\n<div class=\"clsfoot-div\">\r\n<h4 id=\"1\" class=\"footer_head\">Company</h4>\r\n<ul id=\"11\" class=\"clsfooterul\">\r\n<li><a href=\"{{store url =\'\'}}\">Home</a></li>\r\n<li><a href=\"{{store url =\'about\'}}\">About Us</a></li>\r\n<li><a href=\"{{store url =\'\'}}\">Blog</a></li>\r\n<li><a href=\"{{store url =\'press\'}}\">Press</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"clsfoot-div\">\r\n<h4 id=\"2\" class=\"footer_head\">Get Help</h4>\r\n<ul id=\"12\" class=\"clsfooterul\">\r\n<li><a href=\"{{store url =\'faq\'}}\">FAQ</a></li>\r\n<li><a href=\"{{store url =\'terms\'}}\">Terms of Use</a></li>\r\n<li><a href=\"{{store url =\'privacy\'}}\">Privacy Statement</a></li>\r\n<li><a href=\"{{store url =\'works\'}}\">How It Works</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"clsfoot-div new_dealtxt\">\r\n<h4>Unbeatable Deals</h4>\r\n<p>Yesthanks.com.au is your one stop shop to get huge discounts on fun activities, goods and services in your local area. Our daily deals consist of restaurants, spas, things to do, nightlife, massages, hotels, motels, trades and services and a whole lot more..</p>\r\n<div class=\"clscopyright\">&copy;2015 Yesthanks Pty Ltd. All rights reserved.</div>\r\n</div>\r\n</div>','2015-07-14 06:44:51','2016-01-23 00:08:00',1),(2,'Footer Links Company','footer_links_company','\n<div class=\"links\">\n    <div class=\"block-title\">\n        <strong><span>Company</span></strong>\n    </div>\n    <ul>\n        <li><a href=\"{{store url=\"\"}}about-magento-demo-store/\">About Us</a></li>\n        <li><a href=\"{{store url=\"\"}}contacts/\">Contact Us</a></li>\n        <li><a href=\"{{store url=\"\"}}customer-service/\">Customer Service</a></li>\n        <li><a href=\"{{store url=\"\"}}privacy-policy-cookie-restriction-mode/\">Privacy Policy</a></li>\n    </ul>\n</div>','2015-07-14 06:44:54','2015-07-14 06:44:54',1),(3,'Cookie restriction notice','cookie_restriction_notice_block','<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href=\"{{store direct_url=\"privacy-policy-cookie-restriction-mode\"}}\">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>','2015-07-14 06:44:55','2015-07-14 06:44:55',1),(4,'Copyrights','copyrights','<div class=\"clscopyright\">&copy;2015 Yesthanks Pty Ltd. All rights reserved.</div>','2015-07-14 07:13:20','2016-01-22 14:23:25',0),(5,'How to use coupon','coupon-use','<p><span style=\"color: #181818; font-family: Arial, Helvetica, sans-serif; font-size: 20px;\"><strong>How to use this: </strong> </span></p>\r\n<p><span style=\"color: #181818; font-family: Arial, Helvetica, sans-serif; font-size: 12px;\">1. Print coupon. We recommend that you re-use the back-side of this paper for your next coupon, and help reduce waste. <br /> 2. Check the<strong> Fine Print.</strong> Make an appointment or reservation if required. <br /> 3. Present coupon to Merchant or Service Provider to redeem the amazing deal for a fantastic price.&nbsp;<br /> 4. Enjoy! <br /><br />*We support sustainable businesses because they share our values.</span></p>','2015-07-14 07:13:20','2016-02-28 04:44:40',1),(6,'Coupon footer','coupon-footer','<table style=\"width: 100%;\" cellspacing=\"0\" cellpadding=\"0\" bgcolor=\"#dbdbdb\">\r\n<tbody>\r\n<tr>\r\n<td width=\"5%\">&nbsp;</td>\r\n<td style=\"padding: 5px 0;\" width=\"48%\"><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: xx-small;\"> Support: Contact Merchant Supplying Deal or 0400 462 676 for Yesthanks Support</span></td>\r\n<td width=\"2%\">&nbsp;</td>\r\n<td style=\"padding: 5px 0;\" valign=\"top\" width=\"40%\"><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: xx-small;\">Email : admin@yesthanks.com.au</span></td>\r\n<td width=\"5%\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>','2015-07-14 07:13:20','2016-01-23 05:47:43',1),(7,'Privacy Policy','privacypolicy','<p class=\"MLHeadingTitle\">Privacy Policy</p>\r\n<p class=\"MLHeadingTitle\">&nbsp;</p>\r\n<ol>\r\n<li>Overview</li>\r\n</ol>\r\n<p class=\"MLNumber2NB\">1.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; This privacy policy (Privacy Policy) sets out how Yesthanks collects, stores, uses, protects, shares and discloses your personal information. It applies to the Website and all related websites, applications, services and tools (together the Website). By visiting or using the Website you agree to the collection, storage, usage and disclosure of your personal information by Yesthanks in the manner described in this Privacy Policy.&nbsp;</p>\r\n<p class=\"MLNumber2NB\">1.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You agree, consent and acknowledge that we may in our sole discretion sell, disclose, license and/or rent your personal information to a third party for that third party&rsquo;s marketing or other purposes.</p>\r\n<p class=\"MLNumber2NB\">1.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We reserve the right to amend this Privacy Policy at any time by posting an updated version of this Privacy Policy on the Website.&nbsp; By continuing to use the Website after notice of changes has been published on the Website, you are deemed to have consented to the changes.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Definitions</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">2.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Unless otherwise defined, words defined in our Terms of Service have the same meaning in this Privacy Policy.</p>\r\n<p class=\"MLNumber2NB\">2.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In this Privacy Policy, we use the term &ldquo;personal information&rdquo; to describe information that can be associated with a specific person and can be used to identify that person and includes your Information. We do not consider personal information to include information that has been made anonymous or aggregated so that it cannot be used, whether in combination with other information or otherwise, to identify a specific User.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>How we collect personal information</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">3.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Yesthanks collects personal information in a number of ways, including:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; when you provide information directly to Yesthanks through the Website, in person, by phone or in writing (whether by email or any other electronic means, or otherwise);</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; when you visit and/or use the Website, in which case, Yesthanks records information sent to us by your computer, mobile device or other access device; and</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; from third parties such as Yesthanks&rsquo; Related Entities, service providers to Yesthanks, operators of linked websites, applications and advertising on the Website.&nbsp;</p>\r\n<p class=\"MLNumber2NB\">3.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In some circumstances, personal information is provided to us by third parties or other organisations conducting activities on your behalf.&nbsp; It is assumed that you have provided consent for your personal information to be used and disclosed to us this way.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>What we collect</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">4.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may collect the following types of personal information in order to provide the Services:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; your name, phone number, mobile telephone number, email address, and other contact information;&nbsp;</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; any information provided by you;&nbsp;</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; personal information based on your activities on the Website;</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; personal information you provide to us through any discussions boards, correspondence, member information pages, disputes, or shared by you from other social applications, services or websites;</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; to the extent permitted by law, other personal information provided by or obtained from third parties (such as a credit bureau) including navigation and demographic data and credit check information;</p>\r\n<p class=\"MLNumber3\">(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; additional personal information we ask you to provide to verify your identity or when we suspect that you are in breach of our Terms of Service, this Privacy Policy or other Website policies (including your personal ID and your answers to any questions we pose to you);</p>\r\n<p class=\"MLNumber3\">(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; personal information from your interaction with the Website and its content and advertising, including without limitation device identifiers, device type, geo-location information, connection information, statistics on page views, traffic to and from the Website, mobile network information, time, date, referring URL, the type of operating system and browser, ad data, IP address and standard web log data; and</p>\r\n<p class=\"MLNumber3\">(h)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; any other information we consider may assist us in marketing our services.</p>\r\n<p class=\"MLNumber2NB\">4.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We understand the importance of protecting children\'s privacy.&nbsp; The Website and any other related sites such as our Facebook, LinkedIn or other social media pages are not intentionally designed for or directed at children under the age of 13 years.&nbsp; It is our policy never to knowingly collect or maintain information about anyone under the age of 13.</p>\r\n<p class=\"MLNumber2NB\">4.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In the event you do not provide personal information that we request, we may not be able to provide the Services to you.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Automatic Collection of your Personal Information</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">5.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; When you visit our Website, our Internet Service Provider automatically records the following information about you:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; your server address;</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; the website you visited immediately prior to ours;</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; your domain name;</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; date and time of your visit to our website;</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; pages you accessed and the information or documents you downloaded;</p>\r\n<p class=\"MLNumber3\">(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; type of browser you used; and</p>\r\n<p class=\"MLNumber3\">(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; any other information we request our Internet Service Provider to record from time to time.</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>How personal information is used</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">6.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Our principal purpose in collecting, using and storing your personal information is to provide the Services in a personalised, safe and efficient manner. You consent to us collecting, using, storing, sharing and disclosing your personal information to:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; operate the Website, generate content and provide customer support and payment services (including updates and improvements);</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; provide, administer and manage the Services;</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; research, develop and improve the Services;&nbsp;</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; communicate with you;</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; conduct surveys to determine use and satisfaction with the Services;</p>\r\n<p class=\"MLNumber3\">(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; generate statistics in relation to the Website;</p>\r\n<p class=\"MLNumber3\">(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; detect, investigate and prevent potentially unlawful acts or omissions or acts or omissions with the potential to breach our Terms of Service, this Privacy Policy or any other Policy;</p>\r\n<p class=\"MLNumber3\">(h)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; enforce our Terms of Service, this Privacy Policy or any other Policy;&nbsp;</p>\r\n<p class=\"MLNumber3\">(i)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; verify information for accuracy or completeness (including by way of verification with third parties);</p>\r\n<p class=\"MLNumber3\">(j)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; comply with our legal obligations, a request by a governmental agency or regulatory authority or legally binding court order;</p>\r\n<p class=\"MLNumber3\">(k)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; combine or aggregate your personal information with information we collect from third parties and use it for the purposes set out this Privacy Policy;</p>\r\n<p class=\"MLNumber3\">(l)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; aggregate and/or make anonymous your personal information, so that it cannot be used, whether in combination with other information or otherwise, to identify you;</p>\r\n<p class=\"MLNumber3\">(m)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; collect fees, such as our information technology and introduction fee, resolve disputes and to identify, test and resolve problems;</p>\r\n<p class=\"MLNumber3\">(n)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; respond to or resolve claims that a User has violated the rights of others;</p>\r\n<p class=\"MLNumber3\">(o)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; enforce a contract or agreement which we have with a Legal Service Provider;</p>\r\n<p class=\"MLNumber3\">(p)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; notify you about the Website and updates to the Website from time to time;</p>\r\n<p class=\"MLNumber3\">(q)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; supply you with generalised, targeted or personalised marketing, advertising and promotional notices, offers and communications, and measure and improve our marketing, advertising and promotions based on your ad customisation preferences; or</p>\r\n<p class=\"MLNumber3\">(r)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; protect a person&rsquo;s rights, property or safety.</p>\r\n<p class=\"MLNumber2NB\">6.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; For the avoidance of doubt you consent to Yesthanks providing the Merchant selected by you through the Website with your personal information to enable them to provide you with the Merchant Offering.</p>\r\n<p class=\"MLNumber2NB\">6.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In the event we share your personal information to third parties in accordance with this clause you agree and acknowledge that Yesthanks does not control the use, storage or disclosure of that information by such third parties (nor their privacy policies if any), who may apply different privacy rules and practices. As a result, in the event you suffer a Loss as a result of the conduct of such third parties in relation to the handling of your personal information, you release and hold harmless Yesthanks (and its Related Entities, officers, directors, agents, employees and contractors) from actions, claims, demands and Losses of every kind and nature, known and unknown, suspected and unsuspected, disclosed and undisclosed, arising out of or in any way connected with such Loss.</p>\r\n<p class=\"MLNumber2NB\">6.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If you access the Website from a shared device or a device of a third party (such as in an internet caf&eacute;), your personal information may also be available to other persons who access that device.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Disclosure of personal information</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">7.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; By submitting data to us electronically, you are providing explicit consent to trans-border transmission of data collected via our website.</p>\r\n<p class=\"MLNumber2NB\">7.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may disclose your personal information to third parties for the purposes contained in clause 6, including without limitation to:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; our staff members;</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Merchants;</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; contractors and outsourced service providers who manage the services we provide to you, including:-</p>\r\n<p class=\"MLNumber4\">(i)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; information technology service providers;</p>\r\n<p class=\"MLNumber4\">(ii)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; installation, maintenance and repair service providers;</p>\r\n<p class=\"MLNumber4\">(iii)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; market research organisations; and</p>\r\n<p class=\"MLNumber4\">(iv)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; debt-recovery agencies;</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; your authorised representatives;</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; third parties to whom you expressly ask us to send, or consent to us sending, your personal information;</p>\r\n<p class=\"MLNumber3\">(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; our professional advisers, including our accountants, lawyers and auditors;</p>\r\n<p class=\"MLNumber3\">(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; government and regulatory authorities and other similar organisations, as required or authorised by law;</p>\r\n<p class=\"MLNumber3\">(h)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; our Related Entities; and</p>\r\n<p class=\"MLNumber3\">(i)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; such entities that we propose to merge with or be acquired by.</p>\r\n<p class=\"MLNumber3\">&nbsp;</p>\r\n<ol>\r\n<li>Other Publications</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">8.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Yesthanks may enable Users to publish comments on certain parts of the Website. If you comment on a publication on the Website, then those comments, including any personal information provided by you or a third party (including your name) may be available and visible to Users.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Use of Cookies</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">9.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We (or a third party providing services to Yesthanks) may use cookies, pixel tags, \"flash cookies&rdquo;, or other local storage provided by your browser or associated applications (each a Cookie and together Cookies). A Cookie is a small file that may be placed on your computer when you visit the Website. Cookies are used on some parts of the Website. Most browsers now recognise when a cookie is offered and permit you to refuse or accept it. If you are not sure whether your browser has this capability, you should check with the software manufacturer, your company\'s technology help desk or your internet service provider. If Cookies are disabled, Yesthanks may not be able to provide you with the full range of Yesthanks\'Services.</p>\r\n<p class=\"MLNumber2NB\">9.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cookies may collect and store your personal information. This Privacy Policy applies to personal information collected via Cookies. You consent and acknowledge that we collect your personal information through Cookies.</p>\r\n<p class=\"MLNumber2NB\">9.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cookies may be used to provide you with the Services, including to identify you as a User of the Website, remember your preferences, customise and measure the effectiveness of the Website and our promotions, advertising and marketing, analyse your usage of the Website, and for security purposes.</p>\r\n<p class=\"MLNumber2NB\">9.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You also may encounter Cookies used by third parties and placed on certain pages of the Website that we do not control and have not authorised (such as webpages created by another User). Yesthanks is neither responsible nor liable for the use of such Cookies.</p>\r\n<p class=\"MLNumber2NB\">9.5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The Website may also include links to third party websites (including links created by users or members) and applications and advertising delivered to the Website by third parties (Linked Sites). Organisations who operate Linked Sites may collect personal information including through the use of Cookies. Yesthanks is not responsible nor liable for Linked Sites and recommends that you read the privacy policies of such Linked Sites before disclosing your personal information. For the avoidance of doubt Linked Sites are not subject to this Privacy Policy.</p>\r\n<p class=\"MLNumber2NB\">9.6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The Website is hosted by an online service provider which may change from time to time.&nbsp; Our service providers\' use of Cookies is not covered by our Privacy Policy.</p>\r\n<p class=\"MLNumber2NB\">9.7&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We reserve the right to collect more extensive information about any attempted access to our Website that raises security issues and make the appropriate disclosures to the relevant authorities.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>No Spam, Spyware or Spoofing</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">10.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You are prohibited from engaging in spam, spyware or spoofing type activities, regardless of whether directed towards Yesthanks or other users of Yesthanks.</p>\r\n<p class=\"MLNumber2NB\">10.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You must not use the Website or anything related to the Website such as emails, to send, upload or distribute spam, viruses or malicious, illegal or prohibited content to the Website or otherwise send content that would breach our Terms of Service or this Privacy Policy.</p>\r\n<p class=\"MLNumber2NB\">10.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may (or we may engage a third party service provider to) take steps to scan and filter messages to check for spam, viruses, phishing attacks and other malicious activity or unlawful or content prohibited by this Privacy Policy and our Terms of Service.</p>\r\n<p class=\"MLNumber2NB\">10.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To report spam, spyware or spoof activities to Yesthanks, email us at admin@Yesthanks.com.au&nbsp;</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Storage and security</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">11.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We store and process your personal information on our host&rsquo;s servers, currently located in multiple locations around the world. You consent to the transfer, storage and retention of that information onto the servers of our host provider used from time to time by Yesthanks, regardless of the location of those servers.&nbsp;</p>\r\n<p class=\"MLNumber2NB\">11.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Yesthanks has taken reasonable steps to protect your personal information. These measures are designed to mitigate, but do not guarantee against, the risk of loss, misuse, unauthorised access, disclosure and alteration.</p>\r\n<p class=\"MLNumber2NB\">11.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To the extent permitted by law, we reserve the right to retain and store your personal information for such period as is deemed necessary by Yesthanks in its sole discretion. If we determine that we no longer need to hold your personal information, we will take reasonable steps to destroy or permanently de-identify that information.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Information Sharing with Social Websites</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">12.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may offer services that allow you to share public aspects of the Website with third party websites such as Google Plus, Twitter, LinkedIn, Facebook and others social media websites.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Access to information</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">13.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You may request to access the personal information we hold about you. All requests for access will be processed within a reasonable time.&nbsp;</p>\r\n<p class=\"MLNumber2NB\">13.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In certain instances we may not be required or able to provide you with access to your personal information.&nbsp; If this occurs we will give you reasons for our decision not to provide you with such access to your personal information.</p>\r\n<p class=\"MLNumber2NB\">13.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; There is no application fee for making a request to access your personal information.&nbsp; However, we may charge an administrative fee for the provision of information in certain circumstances such as if you make repeated requests for information or where the information is held by a third party provider.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Opting out</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">14.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You may opt out of receiving our marketing, advertising and promotional notices, offers and communications by communicating this to us by email to admin@Yesthanks.com.au</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Contact Us</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">15.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If you receive communications purporting to be connected with us or our services that you believe have been sent to you other than in accordance with this Privacy Policy, or in breach of any law, please contact us by email to admin@yesthanks.com.au</p>\r\n<p class=\"MLNumber2NB\">15.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If you have a question regarding this Privacy Policy or you would like to make a complaint, please contact our Privacy Officer by email at: admin@yesthanks.com.au</p>','2015-07-14 07:13:20','2016-01-23 05:50:58',1),(8,'Footer iphone App','footer-iphone','<p><a href=\"#\" target=\"_blank\"><img src=\"{{media url=\"footer/icon_iphone.png\"}}\" alt=\"Iphone App\" /></a></p>\r\n<p>&nbsp;</p>\r\n<h4><a href=\"http://itunes.apple.com/app/groupclone/id413499577?mt=8\" target=\"_blank\">Download iPhone App</a></h4>\r\n<p><a href=\"http://itunes.apple.com/app/groupclone/id413499577?mt=8\" target=\"_blank\">Get iPhone App. Just one click away</a></p>','2015-07-14 07:13:20','2016-03-02 09:52:10',1),(9,'Footer Merchant','footer-merchant','<p><a href=\"{{store url =\'merchant\'}}\"><img src=\"{{media url=\"footer/icon_mlogin.png\"}}\" alt=\"Merchant Login\" /></a></p>\r\n<h4><a href=\"{{store url =\'merchant\'}}\">Merchant Login</a></h4>\r\n<p class=\"footer_txt\"><a href=\"{{store url =\'merchant\'}}\">Merchant Login - Start your own deal today.</a></p>','2015-07-14 07:13:20','2016-01-28 10:10:53',1),(10,'Footer refer a friend','footer-refer','<p><a href=\"{{store url =\'advertsystem/index/invitation\'}}\"><img src=\"{{media url=\"footer/icon_friend.png\"}}\" alt=\"\" /></a></p>\r\n<h4><a href=\"{{store url =\'advertsystem/index/invitation\'}}\">Invite your Friends ! </a></h4>\r\n<p class=\"footer_txt\"><a href=\"{{store url =\'advertsystem/index/invitation\'}}\">Refer a friend and get discount, via Advert System</a></p>','2015-07-14 07:13:20','2016-01-23 05:54:09',0),(11,'Footer Paypal','footer-paypal','<p><img src=\"{{media url=\'footer/icon_paypal.png\'}}\" alt=\"PayPal\" /></p>\r\n<h4>Secure PayPal</h4>\r\n<p>Make a secure payment via PayPal.</p>','2015-07-14 07:13:21','2016-01-23 05:55:28',0),(12,'Side Banner','side_banner','<p><a title=\"Contact\" href=\"http://yesthanks.com.au/index.php/about/\"><img title=\"Advertise here\" src=\"http://www.projectquickclick.com/resources/banner-advertise-here-300x250-8.jpg\" alt=\"Side Banner\" width=\"300\" height=\"250\" /></a></p>','2015-07-14 07:13:21','2016-05-25 13:15:19',1),(13,'Footer Featured Business','footer-fbusiness','<p><a href=\"{{store url =\'fbusiness\'}}\"><img title=\"fbusiness\" src=\"{{media url=\"footer/fbusiness-1.png\"}}\" alt=\"fbusiness\" /></a></p>\r\n<h4><a href=\"{{store url =\'fbusiness\'}}\">For Your Business</a></h4>\r\n<p class=\"footer_txt\"><a href=\"{{store url =\'fbusiness\'}}\">Get your business featured on {{config path=\"general/store_information/name\"}} and reach even more \"Buyers\".</a></p>','2015-07-14 07:13:21','2016-07-02 06:57:59',0),(14,'Terms and Condition for merchant registration','merchantterms','<p align=\"center\"><span><strong>PLEASE READ - BEFORE GETTING STARTED</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>A few quick rules to ensure both the Merchant and Customer have an enjoyable Yesthanks experience. (These rules are also covered in our Terms and Conditions): -</p>\r\n<ul>\r\n<li>Do not post any profanity</li>\r\n<li>Do not post any nudity whatsoever</li>\r\n<li>Do not make false or misleading posts</li>\r\n<li>Choose only the single relevant category</li>\r\n<li>Please post ads in English. If your target audience speaks another language then please post both in English and the required language</li>\r\n<li>No international posts allowed as Yesthanks is for Australian businesses only</li>\r\n<li>Do not discriminate towards race, sex, religion etc</li>\r\n<li>And anything else prohibited by Australian Law</li>\r\n</ul>\r\n<p>Any of these abuses of the site may result in criminal prosecution and you may at Yesthanks discretion be removed from the site without warning.</p>\r\n<p>If you have any questions regarding the above or you see anyone breaking these rules please contact - admin@yesthanks.com.au</p>\r\n<p>We at Yesthanks know that all of you fantastic Business owners and or employees that have signed up to this service would never abuse our trust and we look forward to building a wonderful business partnership with you all.</p>\r\n<p>&nbsp;</p>\r\n<p>Best Regards</p>\r\n<p>The Yesthanks Team!</p>\r\n<p>&nbsp;</p>\r\n<p><span>MERCHANT TERMS AND CONDITIONS</span></p>\r\n<p class=\"MLBodyText\">These Merchant Terms and Conditions (the &ldquo;Terms and Conditions&rdquo;) govern the arrangement between Yesthanks Pty Ltd (\"<strong>Yesthanks</strong>\") and the Merchant. Yesthanks may amend these Terms and Conditions in its sole discretion and at any time. The most recent version of the Terms and Conditions (as may be amended by Yesthanks from time to time) will be published on Yesthanks.com.au (\"<strong>Website</strong>\").</p>\r\n<p class=\"MLBodyText\">&nbsp;</p>\r\n<p class=\"MLNumber1\"><strong>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>DEFINITIONS</strong></p>\r\n<p class=\"MLNumber1\"><strong><br /></strong></p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Deal\"&nbsp;</strong>means a deal offered in a Voucher.</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Fine Print\"</strong>&nbsp;means the conditions and restrictions concerning Voucher redemption and the Merchant Offering stated on the Website and Voucher.</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Intellectual Property&rdquo;</strong>&nbsp;means all intellectual property rights, including without limitation inventions, patents, copyright, rights in circuit layouts, registered designs, trademarks, know-how, processes, concepts, intellectual property in name \"Yesthanks\", the Website, the system developed by Yesthanks and used on the Website and the source code for that system, and any right to have Information kept confidential and any application or right to apply for registration of any of the these rights throughout the world whether registered or unregistered and whether developed before or after the date of these Terms and Conditions.</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Loss\"</strong>&nbsp;means any direct, indirect, special or consequential loss, damages, cost, expense, penalty, liability, charge or tax of any nature whatsoever, including loss of profit, opportunity, goodwill, business, production or stolen information, programs or other data (however arising or caused, including, without limitation, negligence).</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Maximum Number of Deals\"&nbsp;</strong>means the number of Deals the Merchant may provide in accordance with the terms of its Subscription.</p>\r\n<p class=\"MLNumber3\">(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Maximum Number of Vouchers\"</strong>&nbsp;means the maximum number of Vouchers Yesthanks is authorized to administer the sale of on behalf of the Merchant.</p>\r\n<p class=\"MLNumber3\">(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Merchant\"</strong>&nbsp;means a third party unrelated to Yesthanks that sells, supplies and/or provides the Merchant Offering. Yesthanks does not sell, supply and/or provide the Merchant Offering. It provides a platform by which the Merchant can sell and supply the Voucher.</p>\r\n<p class=\"MLNumber3\">(h)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Merchant Offering\"</strong>&nbsp;means the goods and/or services to be supplied and/or provided by the Merchant to the Voucher Holder, as specified on the Website and on the Voucher.</p>\r\n<p class=\"MLNumber3\">(i)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Payment\"</strong>&nbsp;means the amount a purchaser pays for each Voucher less any amount owed to Yesthanks by the Merchant from time to time.</p>\r\n<p class=\"MLNumber3\">(j)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Policy\"</strong>&nbsp;refers to any policy of Yesthanks in place from time to time including without limitation any policy relating to privacy, fees, refunds, feedback and service.</p>\r\n<p class=\"MLNumber3\">(k)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Promotional Value Expiration Date\"</strong>&nbsp;means the date stated on the Voucher when the Promotional Value expires.</p>\r\n<p class=\"MLNumber3\">(l)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Purchaser Information\"</strong>&nbsp;means any information relating to a purchaser of a Voucher.</p>\r\n<p class=\"MLNumber3\">(m)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Related Entity\"</strong>has the meaning given to it in section 9 of the&nbsp;<em>Corporations Act 2001</em>&nbsp;(Cth).</p>\r\n<p class=\"MLNumber3\">(n)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Subscription\"&nbsp;</strong>means the subscription offer selected by the Merchant through the Website or as otherwise agreed between the parties, which entitles the Merchant to sell a certain number of Deals through the Website per month, being either bronze, silver or gold.</p>\r\n<p class=\"MLNumber3\">(o)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Subscription Fee\"&nbsp;</strong>means the monthly fee payable to Yesthanks by the Merchant which entitles the Merchant to list the number of Vouchers as agreed by the parties.</p>\r\n<p class=\"MLNumber3\">(p)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Voucher\"</strong>&nbsp;means an instrument, in either physical or electronic form, which entitles the holder of such Voucher (the \"<strong>Voucher Holder</strong>\") to receive the Merchant Offering from the Merchant during the period of time stated on the Voucher (the \"<strong>Redemption Period</strong>\").</p>\r\n<p class=\"MLNumber3\">&nbsp;</p>\r\n<p class=\"MLNumber1\"><strong>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>INTERPRETATION</strong></p>\r\n<p class=\"MLNumber1\">&nbsp;</p>\r\n<p class=\"MLIndent1\">In these Terms and Conditions, unless inconsistent with the context or subject matter:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;a reference to a person includes any other legal entity;</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;a reference to a legal entity includes a person;</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;words importing the singular number include the plural number;</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;words importing the plural number include the singular number;</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;the masculine gender must be read as also importing the feminine or neuter gender;</p>\r\n<p class=\"MLNumber3\">(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;a reference to a party includes the party\'s heirs, executors, successors and permitted assigns;</p>\r\n<p class=\"MLNumber3\">(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;headings are for reference purposes only and must not be used in interpretation;</p>\r\n<p class=\"MLNumber3\">(h)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;where any word or phrase is given a defined meaning any other part of speech or other grammatical form concerning the word or phrase has a corresponding meaning;</p>\r\n<p class=\"MLNumber3\">(i)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;a reference to a statute includes all regulations and subordinate legislation and amendments;</p>\r\n<p class=\"MLNumber3\">(j)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;references to writing include any mode of representing or reproducing words in tangible and permanently visible form, and includes e-mail and fax;</p>\r\n<p class=\"MLNumber3\">(k)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;a reference to a monetary amount is a reference to an Australian currency amount;</p>\r\n<p class=\"MLNumber3\">(l)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;an obligation of two or more parties binds them jointly and each of them severally;</p>\r\n<p class=\"MLNumber3\">(m)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;an obligation incurred in favour of two or more parties is enforceable by them severally;</p>\r\n<p class=\"MLNumber3\">(n)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;references to time are to local time in Queensland;</p>\r\n<p class=\"MLNumber3\">(o)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;where time is to be reckoned from a day or event, the day or the day of the event must be excluded;</p>\r\n<p class=\"MLNumber3\">(p)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;a reference to a business day means any day on which trading banks are open for business in Queensland;</p>\r\n<p class=\"MLNumber3\">(q)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if any time period specified in these Terms and Conditions expires on a day which is not a business day, the period shall expire at the end of the next business day;</p>\r\n<p class=\"MLNumber3\">(r)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;a reference to a month means a calendar month; and</p>\r\n<p class=\"MLNumber3\">(s)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;a reference to data includes metadata.</p>\r\n<p class=\"MLNumber3\">&nbsp;</p>\r\n<p class=\"MLNumber1\"><strong>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>VOUCHER PROGRAM</strong></p>\r\n<p class=\"MLNumber1\"><strong><br /></strong></p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The Merchant will list its Vouchers for sale through the Website, and will control the Maximum Number of Vouchers to be sold through the Website. The Merchant warrants that it actually has the goods or services referred to in the Voucher for sale on the terms contained in the Fine Print.</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The Merchant is only entitled to sell the Maximum Number of Deals per month.</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Yesthanks is authorized to promote and sell Vouchers on Merchant\'s behalf subject to the terms of these Terms and Conditions. The Voucher will evidence the Merchant Offering and will be sent to the purchaser electronically once payment is received. The purchaser will then redeem the Voucher with the Merchant by presenting the Voucher in paper or electronic form. Merchant is the issuer of the Vouchers and seller of the Merchant Offering.</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Yesthanks is authorized to promote and sell Vouchers on Merchant\'s behalf through any platform, including its feature deal-of-the-day, affiliates, business partner network, marketplace, or referral network. The Vouchers may be offered to all or part of Yesthanks\' subscriber base or its affiliate subscriber base or referral network and segmented by various variables including gender, age, location, and consumer preferences.</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Yesthanks reserves the continuing right to reject, revise, or discontinue any Merchant Offering, at any time and for any reason in Yesthanks\' sole discretion, and to terminate the Merchant Offering and to remove all references to the Merchant Offering and Voucher from the Website; and redirect or delete any URL used in connection with the Merchant Offering.</p>\r\n<p class=\"MLNumber3\">(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Merchant shall honour the Vouchers for the Merchant Offering through the Promotional Value Expiration Date. After the Promotional Value Expiration Date, Merchant agrees to honour the Vouchers for at least the Amount Paid or for the Full Offer Value if required by law.</p>\r\n<p class=\"MLNumber3\">(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;If applicable, and if a customer redeems a Voucher for less than the Amount Paid, the Merchant is responsible for handling any unredeemed value as required by applicable law.</p>\r\n<p class=\"MLNumber3\">(h)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Merchant agrees that in providing the Merchant Offering, Merchant will not inflate prices or impose any additional fees, charges, conditions or restrictions that contradict or are inconsistent with the terms stated on the Voucher, including the Fine Print. Unless disclosed in the Fine Print, Merchant further agrees not to impose different terms or a different cancellation policy than what is imposed on its non-Yesthanks customers.</p>\r\n<p class=\"MLNumber3\">(i)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Merchant agrees that so long as an appointment or reservation is made to redeem a Voucher, or customer has made an attempt to make an appointment, before the Voucher\'s Promotional Value Expiration Date, the Voucher will be honoured for the Full Offer Value without restriction, even though the services may be provided after the Promotional Value Expiration Date.</p>\r\n<p class=\"MLNumber3\">(j)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Merchant is responsible for all customer service in connection with the Merchant Offering and for supplying all goods and services stated in the Merchant Offering. Merchant is also responsible for any customer loyalty programs associated with the Merchant Offering.</p>\r\n<p class=\"MLNumber3\">(k)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;If applicable, Merchant will hold the Merchant Offering for pick-up by each purchaser at the Redemption Site. The \"Redemption Site\" is the complete and accurate address provided by Merchant to Yesthanks where purchasers are able to redeem the Voucher to pick-up the Merchant Offering. Merchant also agrees to provide Yesthanks with the hours and dates of operation, complete with any exceptions, and a valid phone number for the Redemption Site. If any of the information related to a Redemption Site changes, Merchant agrees to notify Yesthanks immediately of such change by updating its details on the Website.</p>\r\n<p class=\"MLNumber3\">(l)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Merchant agrees to accept refunds and returns of the Merchant Offering in compliance with applicable laws and the Fine Print.</p>\r\n<p class=\"MLNumber3\">&nbsp;</p>\r\n<p class=\"MLNumber1\"><strong>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>PAYMENT</strong></p>\r\n<p class=\"MLNumber1\"><strong><br /></strong></p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The Payment will be paid to the Merchant through Stripe (stripe.com/au) via a split payment gateway and will be reduced by any fees or charges payable to Stripe in respect of this service.&nbsp;</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;On creating an account with Yesthanks, the Merchant may be required to set up an account with Stripe as directed by Yesthanks.</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The Merchant is required to pay Yesthanks the Subscription Fee in accordance with the payment terms of that Subscription Fee, which will be monthly unless otherwise agreed by the parties.</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;The parties acknowledge and agree that upon paying the Payment in respect of a Voucher, a contract is entered into between the Merchant and the purchaser, and the Payment is deemed to have been received directly by the Merchant. For the avoidance of doubt Yesthanks is not a party to this contract and is not responsible for the Payment in anyway whatsoever, including payment of taxes in respect of the Payment.</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;For the avoidance of doubt the Subscription Fee and any other fees paid by the Merchant to Yesthanks is non-refundable to the extent permitted by law.</p>\r\n<p class=\"MLNumber3\">&nbsp;</p>\r\n<p class=\"MLNumber1\"><strong>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>MARKETING</strong></p>\r\n<p class=\"MLNumber1\"><strong><br /></strong></p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Yesthanks and its business partners may communicate with Merchant with regard to products, promotions, and other services that may be of interest to Merchant. This may include email or other communications.</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Yesthanks may also solicit Merchant&rsquo;s opinion and feedback for market research purposes. The Merchant agrees and acknowledges that Yesthanks may use any opinion or feedback whatsoever provided to Yesthanks by the Merchant including without limitation comments or suggestions about Yesthanks, the Website and/or Yesthanks Services without any obligation to compensate the Merchant for them (just as the Merchant has no obligation to offer them).</p>\r\n<p class=\"MLNumber3\">&nbsp;</p>\r\n<p class=\"MLNumber1\"><strong>6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>PROVISION OF SERVICES</strong></p>\r\n<p class=\"MLNumber1\"><strong><br /></strong></p>\r\n<p class=\"MLNumber2\"><a name=\"_Toc404411307\"></a><a name=\"_Toc404404453\"></a>6.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Yesthanks confirms and the Merchant acknowledges that Yesthanks is not providing servicesand it is not a party to any transaction arising or entered into between a purchaser of a Voucher and Merchants. Yesthanks is only offering a Website which provides an online introduction between purchasers requiring Vouchers, andMerchants who provideVouchers.</p>\r\n<p class=\"MLNumber2\">&nbsp;</p>\r\n<p class=\"MLNumber1\"><a name=\"_Toc404404456\"></a><a name=\"_Toc404411308\"></a><strong>7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>DISPUTES</strong></p>\r\n<p class=\"MLNumber1\"><strong><br /></strong></p>\r\n<p class=\"MLNumber2\"><a name=\"_Toc404411312\"></a>7.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;In the event of a dispute between a purchaser and the Merchant, the Merchant acknowledges and agrees that:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;the purchaser is permitted to notify Yesthanks of the dispute;</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;once Yesthanks is notified of a dispute, Yesthanks may liaise with the purchaser and the Merchant in order to attempt to resolve the disp