nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a reference to a monetary amount is a reference to an Australian currency amount;</p>\r\n<p class=\"MLNumber3\">(l)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; an obligation of two or more parties binds them jointly and each of them severally;</p>\r\n<p class=\"MLNumber3\">(m)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; an obligation incurred in favour of two or more parties is enforceable by them severally;</p>\r\n<p class=\"MLNumber3\">(n)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; references to time are to local time in Queensland;</p>\r\n<p class=\"MLNumber3\">(o)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; where time is to be reckoned from a day or event, the day or the day of the event must be excluded;</p>\r\n<p class=\"MLNumber3\">(p)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a reference to a business day means any day on which trading banks are open for business in Queensland;</p>\r\n<p class=\"MLNumber3\">(q)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; if any time period specified in this agreement expires on a day which is not a business day, the period shall expire at the end of the next business day;</p>\r\n<p class=\"MLNumber3\">(r)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a reference to a month means a calendar month; and</p>\r\n<p class=\"MLNumber3\">(s)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; a reference to data includes metadata.</p>\r\n<p class=\"MLNumber2\">1.5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Our Services are available only to, and may only be used by, persons who can form legally binding contracts under applicable law. Without limiting the foregoing, our Services are not available to persons under 18 years of age or to temporarily or indefinitely suspended Users. If you do not qualify, please do not use our Services.&nbsp;</p>\r\n<ol>\r\n<li>Privacy</li>\r\n</ol>\r\n<p class=\"MLNumber2\"