or contractors be liable to you or anyone else for any decision made or action taken or omission in reliance on the information in this or linked to the Site or for any consequential, special or similar damages or other Loss, even if advised of the possibility of such damages. Certain links in the Site connect to other websites maintained by third parties over whom Yesthanks has no control. Yesthanks makes no representations as to the accuracy or any other aspect of information contained in other websites.&nbsp;</p>\r\n<p class=\"MLNumber2\">4.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; All Yesthanks Information in this site is provided to the extent permitted by law, with no guarantee of completeness, accuracy, timeliness or of the results obtained from the use of this Yesthanks Information, and without warranty of any kind, express or implied, including, but not limited to warranties of performance, merchantability and fitness for a particular purpose. Given the changing nature of laws, rules and regulations, and the inherent hazards of electronic communication, there may be delays, omissions or inaccuracies in Yesthanks Information.</p>\r\n<ol>\r\n<li>Purchase Of A Voucher</li>\r\n</ol>\r\n<p class=\"MLNumber2\">5.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You must be at least 18 years old to purchase a Voucher. Before you can make a purchase you may need to register and create an account with Yesthanks, as determined by Yesthanks from time to time.</p>\r\n<p class=\"MLNumber2\">5.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; By clicking on the \"Buy Now\" or other similar button you submit an offer to Yesthanks to buy the Voucher. However, the purchase of the Voucher is not complete until you receive an email from Yesthanks confirming acceptance of your offer. Yesthanks expressly reserves the right to reject your offer. In addition, even if Yesthanks has accepted your offer, it can cancel the contract at any time if it reasonably suspects that you have committed or that you may be committing any fraud against Yesthanks, an affiliated third party of Yesthanks or the Merchant.</p>\r\n<p class=\"MLNumber2\">5.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The Merchant may have its own terms and conditions applicable to the sale, supply and/or provision of the Merchant Offering.</p>\r\n<ol>\r\n<li>Redemption Of A Voucher</li>\r\n</ol>\r\n<p class=\"MLNumber2\">6.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Unless expressly stated otherwise:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; the Voucher can only be redeemed once;</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; the Voucher can only be redeemed with the Merchant and not with Yesthanks;</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; the Voucher is valid for one person only, unless otherwise stated; and</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; you must follow the redemption instructions associated with the Voucher when you redeem the Voucher with the Merchant</p>\r\n<p class=\"MLNumber2\">6.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; All Vouchers issued by Yesthanks are single-purpose Vouchers which can only be redeemed with the Merchant.</p>\r\n<p class=\"MLNumber2\">6.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In order to redeem a Voucher you must present it to the Merchant within the Redemption Period. If you do not redeem the Voucher within the Redemption Period, the Voucher expires automatically. It cannot be redeemed anymore.</p>\r\n<p class=\"MLNumber2\">6.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In the event that a Merchant Offering is required to be posted to you, Yesthanks will collect your shipping details at the time of purchase. Yesthanks will then pass these details to the Merchant on your behalf. The Merchant will then process the redemption of your Voucher and dispatch the Merchant Offering to you.</p>\r\n<p class=\"MLNumber2\">6.5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Unless expressly stated otherwise, the Voucher does not entitle the Voucher Holder to receive the Merchant Offering at a specific time. You are strongly recommended to contact the Merchant at an early stage. Doing so will give you the best chance of securing your preferred time for the supply and/or provision of the Merchant Offering. Yesthanks cannot influence the supply and/or provision of the Merchant Offering.</p>\r\n<p class=\"MLNumber2\">6.6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If you do redeem the Voucher for goods and/or services other than the Merchant Offering, you will not be entitled to a credit, cash refund or new Voucher for the difference between the value of the Merchant Offering and the actual value of the goods and/or services supplied and/or provided by the Merchant to you.</p>\r\n<p class=\"MLNumber2\">6.7&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Vouchers are redeemable in their entirety only. They may not be redeemed partially or incrementally. If, for whatever reason, you redeem the Voucher with a Merchant for less than the original (un-discounted) value of the Merchant Offering, you are not entitled to a credit, cash refund or new Voucher for the difference between the original (un-discounted) value and the redeemed value.</p>\r\n<p class=\"MLNumber2\">6.8&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In the event that a Merchant cannot supply and/or provide the Merchant Offering as described for unforeseen reasons, Yesthanks will notify you as soon as possible by email. Yesthanks will offer you either a new voucher with comparable benefits (if available) or the repayment of the purchase price of the Voucher or by issuing Yesthanks credit.</p>\r\n<ol>\r\n<li>Use Of A Voucher</li>\r\n</ol>\r\n<p class=\"MLNumber2\">7.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Any purchase of a Voucher is for your non-commercial, personal use only (although you may give the Voucher to someone else for their non-commercial, personal use).</p>\r\n<p class=\"MLNumber2\">7.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Your Voucher is solely your responsibility. Neither Yesthanks nor the Merchant are responsible for lost or stolen Vouchers or for retrieving Voucher reference numbers or Voucher security codes.</p>\r\n<p class=\"MLNumber2\">7.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You promise not to provide false data including false names, addresses and/or contact or payment details; or engage in any unlawful activity in connection with the purchase or use of a Voucher, or allow anyone else to do so.</p>\r\n<p class=\"MLNumber2\">7.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Any attempt to redeem a Voucher contrary to these Terms of Service may render a Voucher void at Yesthanks\' discretion.</p>\r\n<p class=\"MLNumber2\">7.5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The reproduction of a Voucher is prohibited.</p>\r\n<p class=\"MLNumber2\">7.6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The commercial trade of a Voucher is prohibited.</p>\r\n<ol>\r\n<li>Delivery Of Goods</li>\r\n</ol>\r\n<p class=\"MLNumber2\">8.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In the event the subject of the Voucher is the purchase of goods that are required to be posted to you, the prices for that Voucher may or may not include delivery charges. Any such charges will be stated in the Fine Print. If delivery charges are not included, such costs will be displayed separately and added to the total amount due before you complete your order.</p>\r\n<p class=\"MLNumber2\">8.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Yesthanks Goods shipping options and fees will be set forth in the Fine Print and will vary by offer. Your purchase is not eligible for shipment outside Australia.</p>\r\n<p class=\"MLNumber2\">8.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Delivery estimates are provided in the Fine Print of the offer. The Merchant will take reasonable steps to meet the date given for delivery, however unless otherwise stated, delivery estimates are only estimates; they are not guaranteed delivery times and should not be relied upon as such.</p>\r\n<p class=\"MLNumber2\">8.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The Merchant has taken reasonable steps to display as accurately as possible the colours and other detailing of the Goods. However, the actual colours and detailing you see on the Website will depend on the equipment you use to view the Goods. We cannot guarantee that the display of any colour or other detailing on your television, mobile device, computer monitor or other device will exactly reflect the colour or detailing of the goods the subject of a Voucher upon delivery.</p>\r\n<p class=\"MLNumber2\">8.5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In the event of any safety concerns or for any other information about a product that relates to health, we recommend you carefully read the information provided with the product or contact the manufacturer. Content on the Website is not intended to substitute for advice given by a medical practitioner, pharmacist or other licensed healthcare professional. Purchasers should contact their healthcare provider immediately if they suspect that they have a medical problem. Information and statements about products the subject of Vouchers are not intended to be used to diagnose, treat, cure or prevent any disease or health condition. We accept no liability for inaccuracies or misstatements about products by manufacturers or other third parties.</p>\r\n<ol>\r\n<li>Cancellation (and Exceptions), Refunds and Problems</li>\r\n</ol>\r\n<p class=\"MLNumber2\">9.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To the extent permitted by law, unless otherwise stated in the Fine Print of the Deal, you may not cancel your purchase or obtain a refund fo