aneous</li>\r\n</ol>\r\n<p class=\"MLNumber2\">15.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Accessing information from the Site is done so at your own risk and you will be responsible for compliance with the laws within your jurisdiction.</p>\r\n<p class=\"MLNumber2\">15.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; TheseTerms of Service are governed by the laws of Queensland and the Commonwealth of Australia which are in force in Queensland and the parties submit to the jurisdiction of the Court of Queensland, relevant Federal Courts and Courts competent to hear appeals from them.</p>\r\n<p class=\"MLNumber2\">15.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; These Terms of Service shall be for the benefit of and binding upon the parties and their heirs, executors, successors and permitted assigns.</p>\r\n<p class=\"MLNumber2\">15.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If a clause of theseTerms of Serviceare void or unenforceable it must be severed from theseTerms of Service and the clauses that are not void or unenforceable are unaffected by the severance.</p>\r\n<p class=\"MLNumber2\">15.5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You agree that these Terms of Service and all incorporated agreements may be assigned by Yesthanks, in our sole discretion, to Related Entities or third parties. You may not assign these Terms of Service without Yesthanks&rsquo; express prior written consent.</p>\r\n<p class=\"MLNumber2\">15.6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Headings are for reference purposes only and in no way define, limit, construe or describe the scope or extent of such section.&nbsp;</p>\r\n<p class=\"MLNumber2\">15.7&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Yesthanks\' failure to act with respect to a breach by you or others does not constitute a waiver of that breach or waive our right to act with respect to that breach or subsequent or similar breaches.&nbsp;</p>\r\n<p class=\"MLNumber2\">15.8&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You agree that these Terms of Service may not be construed adversely against us solely because we prepared them.&nbsp;</p>\r\n<p class=\"MLNumber2\">15.9&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; These Terms of Service and the Policies comprise the entire understanding and agreement between you and us with respect to the subject matter hereof.&nbsp;</p>\r\n<p class=\"MLNumber2\">15.10&nbsp;&nbsp;&nbsp; Nothing in these Terms of Service or your use of the Site establishes or creates a joint venture, partnership, consortium, franchise, employment or agency relationship between the parties including in particular between Yesthanks and Purchasers and Yesthanks and Merchants.</p>\r\n<p class=\"MLNumber2\">15.11&nbsp;&nbsp;&nbsp; Should a dispute arise in connection with these Terms of Service or with your use of the Site which cannot be resolved by good faith negotiations between us and you, Yesthanks may at its sole discretion refer the dispute to mediation or to arbitration. At all times we reserve the right to instigate legal proceedings prior to negotiation, arbitration or mediation against any person including any individual or entity (incorporated or otherwise)), who in our opinion has acted in breach of these Terms of Service.&nbsp;</p>','2015-07-14 06:44:53','2016-03-05 11:54:32',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(5,'Enable Cookies','one_column',NULL,NULL,'enable-cookies',NULL,'<div class=\"std\">\n    <ul class=\"messages\">\n        <li class=\"notice-msg\">\n            <ul>\n                <li>Please enable cookies in your web browser to continue.</li>\n            </ul>\n        </li>\n    </ul>\n    <div class=\"page-title\">\n        <h1><a name=\"top\"></a>What are Cookies?</h1>\n    </div>\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website.\n    On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically\n    whenever you visit our site so that we can personalize your experience and provide you with better service.\n    We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes.\n     If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase\n     or take advantage of certain features of our website, such as storing items in your Shopping Cart or\n     receiving personalized recommendations. As a result, we strongly encourage you to configure your web\n     browser to accept cookies from our website.</p>\n    <h2 class=\"subtitle\">Enabling Cookies</h2>\n    <ul class=\"disc\">\n        <li><a href=\"#ie7\">Internet Explorer 7.x</a></li>\n        <li><a href=\"#ie6\">Internet Explorer 6.x</a></li>\n        <li><a href=\"#firefox\">Mozilla/Firefox</a></li>\n        <li><a href=\"#opera\">Opera 7.x</a></li>\n    </ul>\n    <h3><a name=\"ie7\"></a>Internet Explorer 7.x</h3>\n    <ol>\n        <li>\n            <p>Start Internet Explorer</p>\n        </li>\n        <li>\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-1.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Privacy</strong> tab</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-2.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Advanced</strong> button</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-3.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>,\n            put another check mark in the <strong>Always accept session cookies </strong>box</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-4.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-5.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie7-6.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Restart Internet Explore</p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"ie6\"></a>Internet Explorer 6.x</h3>\n    <ol>\n        <li>\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\n            <p><img src=\"{{skin url=\"images/cookies/ie6-1.gif\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> tab</p>\n        </li>\n        <li>\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>)\n            under <strong>Settings</strong>. Click <strong>OK</strong></p>\n            <p><img src=\"{{skin url=\"images/cookies/ie6-2.gif\"}}\" alt=\"\" /></p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"firefox\"></a>Mozilla/Firefox</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\n            <p><img src=\"{{skin url=\"images/cookies/firefox.png\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>Expand the <strong>Cookies</strong> section</p>\n        </li>\n        <li>\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n    <h3><a name=\"opera\"></a>Opera 7.x</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\n            <p><img src=\"{{skin url=\"images/cookies/opera.png\"}}\" alt=\"\" /></p>\n        </li>\n        <li>\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong>\n            should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong></p>\n        </li>\n    </ol>\n    <p class=\"a-top\"><a href=\"#top\">Back to Top</a></p>\n</div>\n','2015-07-14 06:44:53','2015-07-14 06:44:53',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(6,'Privacy Policy','one_column',NULL,NULL,'privacy-policy-cookie-restriction-mode','Privacy Policy','<p class=\"MLHeadingTitle\">Privacy Policy</p>\r\n<p class=\"MLHeadingTitle\">&nbsp;</p>\r\n<ol>\r\n<li>Overview</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">1.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; This privacy policy (Privacy Policy) sets out how Yesthanks collects, stores, uses, protects, shares and discloses your personal information. It applies to the Website and all related websites, applications, services and tools (together the Website). By visiting or using the Website you agree to the collection, storage, usage and disclosure of your personal information by Yesthanks in the manner described in this Privacy Policy.&nbsp;</p>\r\n<p class=\"MLNumber2NB\">1.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You agree, consent and acknowledge that we may in our sole discretion sell, disclose, license and/or rent your personal information to a thir