us by your computer, mobile device or other access device; and</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; from third parties such as Yesthanks&rsquo; Related Entities, service providers to Yesthanks, operators of linked websites, applications and advertising on the Website.&nbsp;</p>\r\n<p class=\"MLNumber2NB\">3.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In some circumstances, personal information is provided to us by third parties or other organisations conducting activities on your behalf.&nbsp; It is assumed that you have provided consent for your personal information to be used and disclosed to us this way.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>What we collect</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">4.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may collect the following types of personal information in order to provide the Services:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; your name, phone number, mobile telephone number, email address, and other contact information;&nbsp;</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; any information provided by you;&nbsp;</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; personal information based on your activities on the Website;</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; personal information you provide to us through any discussions boards, correspondence, member information pages, disputes, or shared by you from other social applications, services or websites;</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; to the extent permitted by law, other personal information provided by or obtained from third parties (such as a credit bureau) including navigation and demographic data and credit check information;</p>\r\n<p class=\"MLNumber3\">(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; additional personal information we ask you to provide to verify your identity or when we suspect that you are in breach of our Terms of Service, this Privacy Policy or other Website policies (including your personal ID and your answers to any questions we pose to you);</p>\r\n<p class=\"MLNumber3\">(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; personal information from your interaction with the Website and its content and advertising, including without limitation device identifiers, device type, geo-location information, connection information, statistics on page views, traffic to and from the Website, mobile network information, time, date, referring URL, the type of operating system and browser, ad data, IP address and standard web log data; and</p>\r\n<p class=\"MLNumber3\">(h)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; any other information we consider may assist us in marketing our services.</p>\r\n<p class=\"MLNumber2NB\">4.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We understand the importance of protecting children\'s privacy.&nbsp; The Website and any other related sites such as our Facebook, LinkedIn or other social media pages are not intentionally designed for or directed at children under the age of 13 years.&nbsp; It is our policy never to knowingly collect or maintain information about anyone under the age of 13.</p>\r\n<p class=\"MLNumber2NB\">4.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In the event you do not provide personal information that we request, we may not be able to provide the Services to you.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Automatic Collection of your Personal Information</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">5.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; When you visit our Website, our Internet Service Provider automatically records the following information about you:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; your server address;</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; the website you visited immediately prior to ours;</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; your domain name;</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; date and time of your visit to our website;</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; pages you accessed and the information or documents you downloaded;</p>\r\n<p class=\"MLNumber3\">(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; type of browser you used; and</p>\r\n<p class=\"MLNumber3\">(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; any other information we request our Internet Service Provider to record from time to time.</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>How personal information is used</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">6.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Our principal purpose in collecting, using and storing your personal information is to provide the Services in a personalised, safe and efficient manner. You consent to us collecting, using, storing, sharing and disclosing your personal information to:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; operate the Website, generate content and provide customer support and payment services (including updates and improvements);</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; provide, administer and manage the Services;</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; research, develop and improve the Services;&nbsp;</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; communicate with you;</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; conduct surveys to determine use and satisfaction with the Services;</p>\r\n<p class=\"MLNumber3\">(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; generate statistics in relation to the Website;</p>\r\n<p class=\"MLNumber3\">(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; detect, investigate and prevent potentially unlawful acts or omissions or acts or omissions with the potential to breach our Terms of Service, this Privacy Policy or any other Policy;</p>\r\n<p class=\"MLNumber3\">(h)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; enforce our Terms of Service, this Privacy Policy or any other Policy;&nbsp;</p>\r\n<p class=\"MLNumber3\">(i)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; verify information for accuracy or completeness (including by way of verification with third parties);</p>\r\n<p class=\"MLNumber3\">(j)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; comply with our legal obligations, a request by a governmental agency or regulatory authority or legally binding court order;</p>\r\n<p class=\"MLNumber3\">(k)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; combine or aggregate your personal information with information we collect from third parties and use it for the purposes set out this Privacy Policy;</p>\r\n<p class=\"MLNumber3\">(l)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; aggregate and/or make anonymous your personal information, so that it cannot be used, whether in combination with other information or otherwise, to identify you;</p>\r\n<p class=\"MLNumber3\">(m)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; collect fees, such as our information technology and introduction fee, resolve disputes and to identify, test and resolve problems;</p>\r\n<p class=\"MLNumber3\">(n)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; respond to or resolve claims that a User has violated the rights of others;</p>\r\n<p class=\"MLNumber3\">(o)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; enforce a contract or agreement which we have with a Legal Service Provider;</p>\r\n<p class=\"MLNumber3\">(p)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; notify you about the Website and updates to the Website from time to time;</p>\r\n<p class=\"MLNumber3\">(q)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; supply you with generalised, targeted or personalised marketing, advertising and promotional notices, offers and communications, and measure and improve our marketing, advertising and promotions based on your ad customisation preferences; or</p>\r\n<p class=\"MLNumber3\">(r)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; protect a person&rsquo;s rights, property or safety.</p>\r\n<p class=\"MLNumber2NB\">6.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; For the avoidance of doubt you consent to Yesthanks providing the Merchant selected by you through the Website with your personal information to enable them to provide you with the Merchant Offering.</p>\r\n<p class=\"MLNumber2NB\">6.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In the event we share your personal information to third parties in accordance with this clause you agree and acknowledge that Yesthanks does not control the use, storage or disclosure of that information by such third parties (nor their privacy policies if any), who may apply different privacy rules and practices. As a result, in the event you suffer a Loss as a result of the conduct of such third parties in relation to the handling of your personal information, you release and hold harmless Yesthanks (and its Related Entities, officers, directors, agents, employees and contractors) from actions, claims, demands and Losses of every kind and nature, known and unknown, suspected and unsuspected, disclosed and undisclosed, arising out of or in any way connected with such Loss.</p>\r\n<p class=\"MLNumber2NB\">6.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If you access the Website from a shared device or a device of a third party (such as in an internet caf&eacute;), your personal information may also be available to other persons who access that device.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Disclosure of personal information</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">7.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; By submitting data to us electronically, you are providing explicit consent to trans-border transmission of data collected via our website.</p>\r\n<p class=\"MLNumber2NB\">7.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may disclose your personal information to third parties for the purposes contained in clause 6, including without limitation to:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; our staff members;</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Merchants;</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; contractors and outsourced service providers who manage the services we provide to you, including:-</p>\r\n<p class=\"MLNumber4\">(i)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; information technology service providers;</p>\r\n<p class=\"MLNumber4\">(ii)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; installation, maintenance and repair service providers;</p>\r\n<p class=\"MLNumber4\">(iii)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; market research organisations; and</p>\r\n<p class=\"MLNumber4\">(iv)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; debt-recovery agencies;</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; your authorised representatives;</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; third parties to whom you expressly ask us to send, or consent to us sending, your personal information;</p>\r\n<p class=\"MLNumber3\">(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; our professional advisers, including our accountants, lawyers and auditors;</p>\r\n<p class=\"MLNumber3\">(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; government and regulatory authorities and other similar organisations, as required or authorised by law;</p>\r\n<p class=\"MLNumber3\">(h)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; our Related Entities; and</p>\r\n<p class=\"MLNumber3\">(i)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; such entities that we propose to merge with or be acquired by.</p>\r\n<p class=\"MLNumber3\">&nbsp;</p>\r\n<ol>\r\n<li>Other Publications</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">8.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Yesthanks may enable Users to publish comments on certain parts of the Website. If you comment on a publication on the Website, then those comments, including any personal information provided by you or a third party (including your name) may be available and visible to Users.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Use of Cookies</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">9.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We (or a third party providing services to Yesthanks) may use cookies, pixel tags, \"flash cookies&rdquo;, or other local storage provided by your browser or associated applications (each a Cookie and together Cookies). A Cookie is a small file that may be placed on your computer when you visit the Website. Cookies are used on some parts of the Website. Most browsers now recognise when a cookie is offered and permit you to refuse or accept it. If you are not sure whether your browser has this capability, you should check with the software manufacturer, your company\'s technology help desk or your internet service provider. If Cookies are disabled, Yesthanks may not be able to provide you with the full range of Yesthanks\'Services.</p>\r\n<p class=\"MLNumber2NB\">9.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cookies may collect and store your personal information. This Privacy Policy applies to personal information collected via Cookies. You consent and acknowledge that we collect your personal information through Cookies.</p>\r\n<p class=\"MLNumber2NB\">9.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cookies may be used to provide you with the Services, including to identify you as a User of the Website, remember your preferences, customise and measure the effectiveness of the Website and our promotions, advertising and marketing, analyse your usage of the Website, and for security purposes.</p>\r\n<p class=\"MLNumber2NB\">9.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You also may encounter Cookies used by third parties and placed on certain pages of the Website that we do not control and have not authorised (such as webpages created by another User). Yesthanks is neither responsible nor liable for the use of such Cookies.</p>\r\n<p class=\"MLNumber2NB\">9.5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The Website may also include links to third party websites (including links created by users or members) and applications and advertising delivered to the Website by third parties (Linked Sites). Organisations who operate Linked Sites may collect personal information including through the use of Cookies. Yesthanks is not responsible nor liable for Linked Sites and recommends that you read the privacy policies of such Linked Sites before disclosing your personal information. For the avoidance of doubt Linked Sites are not subject to this Privacy Policy.</p>\r\n<p class=\"MLNumber2NB\">9.6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The Website is hosted by an online service provider which may change from time to time.&nbsp; Our service providers\' use of Cookies is not covered by our Privacy Policy.</p>\r\n<p class=\"MLNumber2NB\">9.7&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We reserve the right to collect more extensive information about any attempted access to our Website that raises security issues and make the appropriate disclosures to the relevant authorities.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>No Spam, Spyware or Spoofing</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">10.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You are prohibited from engaging in spam, spyware or spoofing type activities, regardless of whether directed towards Yesthanks or other users of Yesthanks.</p>\r\n<p class=\"MLNumber2NB\">10.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You must not use the Website or anything related to the Website such as emails, to send, upload or distribute spam, viruses or malicious, illegal or prohibited content to the Website or otherwise send content that would breach our Terms of Service or this Privacy Policy.</p>\r\n<p class=\"MLNumber2NB\">10.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may (or we may engage a third party service provider to) take steps to scan and filter messages to check for spam, viruses, phishing attacks and other malicious activity or unlawful or content prohibited by this Privacy Policy and our Terms of Service.</p>\r\n<p class=\"MLNumber2NB\">10.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To report spam, spyware or spoof activities to Yesthanks, email us at admin@Yesthanks.com.au&nbsp;</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Storage and security</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">11.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We store and process your personal information on our host&rsquo;s servers, currently located in multiple locations around the world. You consent to the transfer, storage and retention of that information onto the servers of our host provider used from time to time by Yesthanks, regardless of the location of those servers.&nbsp;</p>\r\n<p class=\"MLNumber2NB\">11.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Yesthanks has taken reasonable steps to protect your personal information. These measures are designed to mitigate, but do not guarantee against, the risk of loss, misuse, unauthorised access, disclosure and alteration.</p>\r\n<p class=\"MLNumber2NB\">11.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To the extent permitted by law, we reserve the right to retain and store your personal information for such period as is deemed necessary by Yesthanks in its sole discretion. If we determine that we no longer need to hold your personal information, we will take reasonable steps to destroy or permanently de-identify that information.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Information Sharing with Social Websites</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">12.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may offer services that allow you to share public aspects of the Website with third party websites such as Google Plus, Twitter, LinkedIn, Facebook and others social media websites.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Access to information</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">13.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You may request to access the personal information we hold about you. All requests for access will be processed within a reasonable time.&nbsp;</p>\r\n<p class=\"MLNumber2NB\">13.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In certain instances we may not be required or able to provide you with access to your personal information.&nbsp; If this occurs we will give you reasons for our decision not to provide you with such access to your personal information.</p>\r\n<p class=\"MLNumber2NB\">13.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; There is no application fee for making a request to access your personal information.&nbsp; However, we may charge an administrative fee for the provision of information in certain circumstances such as if you make repeated requests for information or where the information is held by a third party provider.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Opting out</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">14.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You may opt out of receiving our marketing, advertising and promotional notices, offers and communications by communicating this to us by email to admin@Yesthanks.com.au</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Contact Us</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">15.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If you receive communications purporting to be connected with us or our services that you believe have been sent to you other than in accordance with this Privacy Policy, or in breach of any law, please contact us by email to admin@yesthanks.com.au</p>\r\n<p class=\"MLNumber2NB\">15.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If you have a question regarding this Privacy Policy or you would like to make a complaint, please contact our Privacy Officer by email at: admin@yesthanks.com.au</p>\r\n<p>&nbsp;</p>\r\n<p style=\"color: #ff0000; font-weight: bold; font-size: 13px;\">&nbsp;</p>\r\n<h2>What we collect</h2>\r\n<p>We may collect the following information:</p>\r\n<ul>\r\n<li>name</li>\r\n<li>contact information including email address</li>\r\n<li>demographic information such as postcode, preferences and interests</li>\r\n<li>other information relevant to customer surveys and/or offers</li>\r\n</ul>\r\n<p>For the exhaustive list of cookies we collect see the <a href=\"#list\">List of cookies we collect</a> section.</p>\r\n<h2>What we do with the information we gather</h2>\r\n<p>We require this information to understand your needs and provide you with a better service, and in particular for the following reasons:</p>\r\n<ul>\r\n<li>Internal record keeping.</li>\r\n<li>We may use the information to improve our products and services.</li>\r\n<li>We may periodically send promotional emails about new products, special offers or other information which we think you may find interesting using the email address which you have provided.</li>\r\n<li>From time to time, we may also use your information to contact you for market research purposes. We may contact you by email, phone, fax or mail. We may use the information to customise the website according to your interests.</li>\r\n</ul>\r\n<h2>Security</h2>\r\n<p>We are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information we collect online.</p>\r\n<h2>How we use cookies</h2>\r\n<p>A cookie is a small file which asks permission to be placed on your computer\'s hard drive. Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit a particular site. Cookies allow web applications to respond to you as an individual. The web application can tailor its operations to your needs, likes and dislikes by gathering and remembering information about your preferences.</p>\r\n<p>We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page traffic and improve our website in order to tailor it to customer needs. We only use this information for statistical analysis purposes and then the data is removed from the system.</p>\r\n<p>Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful and which you do not. A cookie in no way gives us access to your computer or any information about you, other than the data you choose to share with us. You can choose to accept or decline cookies. Most web browsers automatically accept cookies, but you can usually modify your browser setting to decline cookies if you prefer. This may prevent you from taking full advantage of the website.</p>\r\n<h2>Links to other websites</h2>\r\n<p>Our website may contain links to other websites of interest. However, once you have used these links to leave our site, you should note that we do not have any control over that other website. Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst visiting such sites and such sites are not governed by this privacy statement. You should exercise caution and look at the privacy statement applicable to the website in question.</p>\r\n<h2>Controlling your personal information</h2>\r\n<p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\r\n<ul>\r\n<li>whenever you are asked to fill in a form on the website, look for the box that you can click to indicate that you do not want the information to be used by anybody for direct marketing purposes</li>\r\n<li>if you have previously agreed to us using your personal information for direct marketing purposes, you may change your mind at any time by writing to or emailing us at {{config path=\"trans_email/ident_general/email\"}}</li>\r\n</ul>\r\n<p>We will not sell, distribute or lease your personal information to third parties unless we have your permission or are required by law to do so. We may use your personal information to send you promotional information about third parties which we think you may find interesting if you tell us that you wish this to happen.</p>\r\n<p>You may request details of personal information which we hold about you under the Data Protection Act 1998. A small fee will be payable. If you would like a copy of the information held on you please write to {{config path=\"general/store_information/address\"}}.</p>\r\n<p>If you believe that any information we are holding on you is incorrect or incomplete, please write to or email us as soon as possible, at the above address. We will promptly correct any information found to be incorrect.</p>\r\n<h2><a name=\"list\"></a>List of cookies we collect</h2>\r\n<p>The table below lists the cookies we collect and what information they store.</p>\r\n<table class=\"data-table\">\r\n<thead>\r\n<tr><th>COOKIE name</th><th>COOKIE Description</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr><th>CART</th>\r\n<td>The association with your shopping cart.</td>\r\n</tr>\r\n<tr><th>CATEGORY_INFO</th>\r\n<td>Stores the category info on the page, that allows to display pages more quickly.</td>\r\n</tr>\r\n<tr><th>COMPARE</th>\r\n<td>The items that you have in the Compare Products list.</td>\r\n</tr>\r\n<tr><th>CURRENCY</th>\r\n<td>Your preferred currency</td>\r\n</tr>\r\n<tr><th>CUSTOMER</th>\r\n<td>An encrypted version of your customer id with the store.</td>\r\n</tr>\r\n<tr><th>CUSTOMER_AUTH</th>\r\n<td>An indicator if you are currently logged into the store.</td>\r\n</tr>\r\n<tr><th>CUSTOMER_INFO</th>\r\n<td>An encrypted version of the customer group you belong to.</td>\r\n</tr>\r\n<tr><th>CUSTOMER_SEGMENT_IDS</th>\r\n<td>Stores the Customer Segment ID</td>\r\n</tr>\r\n<tr><th>EXTERNAL_NO_CACHE</th>\r\n<td>A flag, which indicates whether caching is disabled or not.</td>\r\n</tr>\r\n<tr><th>FRONTEND</th>\r\n<td>You sesssion ID on the server.</td>\r\n</tr>\r\n<tr><th>GUEST-VIEW</th>\r\n<td>Allows guests to edit their orders.</td>\r\n</tr>\r\n<tr><th>LAST_CATEGORY</th>\r\n<td>The last category you visited.</td>\r\n</tr>\r\n<tr><th>LAST_PRODUCT</th>\r\n<td>The most recent product you have viewed.</td>\r\n</tr>\r\n<tr><th>NEWMESSAGE</th>\r\n<td>Indicates whether a new message has been received.</td>\r\n</tr>\r\n<tr><th>NO_CACHE</th>\r\n<td>Indicates whether it is allowed to use cache.</td>\r\n</tr>\r\n<tr><th>PERSISTENT_SHOPPING_CART</th>\r\n<td>A link to information about your cart and viewing history if you have asked the site.</td>\r\n</tr>\r\n<tr><th>POLL</th>\r\n<td>The ID of any polls you have recently voted in.</td>\r\n</tr>\r\n<tr><th>POLLN</th>\r\n<td>Information on what polls you have voted on.</td>\r\n</tr>\r\n<tr><th>RECENTLYCOMPARED</th>\r\n<td>The items that you have recently compared.</td>\r\n</tr>\r\n<tr><th>STF</th>\r\n<td>Information on products you have emailed to friends.</td>\r\n</tr>\r\n<tr><th>STORE</th>\r\n<td>The store view or language you have selected.</td>\r\n</tr>\r\n<tr><th>USER_ALLOWED_SAVE_COOKIE</th>\r\n<td>Indicates whether a customer allowed to use cookies.</td>\r\n</tr>\r\n<tr><th>VIEWED_PRODUCT_IDS</th>\r\n<td>The products that you have recently viewed.</td>\r\n</tr>\r\n<tr><th>WISHLIST</th>\r\n<td>An encrypted list of products added to your Wishlist.</td>\r\n</tr>\r\n<tr><th>WISHLIST_CNT</th>\r\n<td>The number of items in your Wishlist.</td>\r\n</tr>\r\n</tbody>\r\n</table>','2015-07-14 06:44:54','2016-01-23 02:23:00',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(7,'Business','two_columns_right',NULL,NULL,'business',NULL,'<div id=\"business\">\r\n<div class=\"page-title\">\r\n<h1>For Businesses</h1>\r\n<p>&nbsp;<span style=\"font-size: x-small;\"><strong>PLEASE READ - BEFORE GETTING STARTED</strong></span></p>\r\n</div>\r\n<p><span style=\"font-size: x-small;\">&nbsp;A few quick rules to ensure both the Merchant and Customer have an enjoyable Yesthanks experience. (These rules are also covered in our Terms and Conditions): -</span></p>\r\n<ul>\r\n<li><span style=\"font-size: x-small;\">Do not post any profanity</span></li>\r\n<li><span style=\"font-size: x-small;\">Do not post any nudity whatsoever</span></li>\r\n<li><span style=\"font-size: x-small;\">Do not make false or misleading posts</span></li>\r\n<li><span style=\"font-size: x-small;\">Choose only the single relevant category</span></li>\r\n<li><span style=\"font-size: x-small;\">Please post ads in English. If your target audience speaks another language then please post both in English and the required language</span></li>\r\n<li><span style=\"font-size: x-small;\">No international posts allowed as Yesthanks is for Australian businesses only</span></li>\r\n<li><span style=\"font-size: x-small;\">Do not discriminate towards race, sex, religion etc</span></li>\r\n<li><span style=\"font-size: x-small;\">And anything else prohibited by Australian Law</span></li>\r\n</ul>\r\n<p><span style=\"font-size: x-small;\">Any of these abuses of the site may result in criminal prosecution and you may at Yesthanks discretion be removed from the site without warning.</span></p>\r\n<p><span style=\"font-size: x-small;\">If you have any questions regarding the above or you see anyone breaking these rules please contact - admin@yesthanks.com.au</span></p>\r\n<p><span style=\"font-size: x-small;\">We at Yesthanks know that all of you fantastic Business owners and or employees that have signed up to this service would never abuse our trust and we look forward to building a wonderful business partnership with you all.</span></p>\r\n<p><span style=\"font-size: x-small;\">&nbsp;Best Regards</span></p>\r\n<p><span style=\"font-size: x-small;\">The Yesthanks Team!</span></p>\r\n<p style=\"padding: 0px; margin: 0px;\"><span style=\"font-size: x-small;\">&nbsp;</span></p>\r\n<p style=\"padding: 0px; margin: 0px;\"><span style=\"font-size: x-small;\">MERCHANT TERMS AND CONDITIONS</span></p>\r\n<p class=\"MLBodyText\"><span style=\"font-size: x-small;\">These Merchant Terms and Conditions (the &ldquo;Terms and Conditions&rdquo;) govern the arrangement between Yesthanks Pty Ltd (\"<strong>Yesthanks</strong>\") and the Merchant. Yesthanks may amend these Terms and Conditions in its sole discretion and at any time. The most recent version of the Terms and Conditions (as may be amended by Yesthanks from time to time) will be published on Yesthanks.com.au (\"<strong>Website</strong>\").</span></p>\r\n<p class=\"MLBodyText\"><span style=\"font-size: x-small;\">&nbsp;<strong>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>DEFINITIONS</strong></span></p>\r\n<p class=\"MLNumber1\"><span style=\"font-size: x-small;\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>\"Deal\" </strong>means a deal offered in a Voucher.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Fine Print\"</strong>&nbsp;means the conditions and restrictions concerning Voucher redemption and the Merchant Offering stated on the Website and Voucher.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Intellectual Property&rdquo;</strong> means all intellectual property rights, including without limitation inventions, patents, copyright, rights in circuit layouts, registered designs, trademarks, know-how, processes, concepts, intellectual property in name \"Yesthanks\", the Website, the system developed by Yesthanks and used on the Website and the source code for that system, and any right to have Information kept confidential and any application or right to apply for registration of any of the these rights throughout the world whether registered or unregistered and whether developed before or after the date of these Terms and Conditions.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Loss\"</strong> means any direct, indirect, special or consequential loss, damages, cost, expense, penalty, liability, charge or tax of any nature whatsoever, including loss of profit, opportunity, goodwill, business, production or stolen information, programs or other data (however arising or caused, including, without limitation, negligence).</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Maximum Number of Deals\" </strong>means the number of Deals the Merchant may provide in accordance with the terms of its Subscription.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Maximum Number of Vouchers\"</strong>&nbsp;means the maximum number of Vouchers Yesthanks is authorized to administer the sale of on behalf of the Merchant.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Merchant\"</strong> means a third party unrelated to Yesthanks that sells, supplies and/or provides the Merchant Offering. Yesthanks does not sell, supply and/or provide the Merchant Offering. It provides a platform by which the Merchant can sell and supply the Voucher.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(h)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Merchant Offering\"</strong>&nbsp;means the goods and/or services to be supplied and/or provided by the Merchant to the Voucher Holder, as specified on the Website and on the Voucher.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(i)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Payment\"</strong>&nbsp;means the amount a purchaser pays for each Voucher less any amount owed to Yesthanks by the Merchant from time to time.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(j)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Policy\"</strong> refers to any policy of Yesthanks in place from time to time including without limitation any policy relating to privacy, fees, refunds, feedback and service.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(k)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Promotional Value Expiration Date\"</strong>&nbsp;means the date stated on the Voucher when the Promotional Value expires.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(l)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Purchaser Information\"</strong> means any information relating to a purchaser of a Voucher.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(m)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Related Entity\"</strong>has the meaning given to it in section 9 of the <em>Corporations Act 2001</em> (Cth).</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(n)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Subscription\" </strong>means the subscription offer selected by the Merchant through the Website or as otherwise agreed between the parties, which entitles the Merchant to sell a certain number of Deals through the Website per month, being either bronze, silver or gold.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(o)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Subscription Fee\" </strong>means the monthly fee payable to Yesthanks by the Merchant which entitles the Merchant to list the number of Vouchers as agreed by the parties.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(p)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><strong>\"Voucher\"</strong> means an instrument, in either physical or electronic form, which entitles the holder of such Voucher (the \"<strong>Voucher Holder</strong>\") to receive the Merchant Offering from the Merchant during the period of time stated on the Voucher (the \"<strong>Redemption Period</strong>\").</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\">&nbsp;<strong>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>INTERPRETATION</strong></span></p>\r\n<p class=\"MLNumber1\"><span style=\"font-size: x-small;\">In these Terms and Conditions, unless inconsistent with the context or subject matter:</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->a reference to a person includes any other legal entity;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->a reference to a legal entity includes a person;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->words importing the singular number include the plural number;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->words importing the plural number include the singular number;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->the masculine gender must be read as also importing the feminine or neuter gender;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->a reference to a party includes the party\'s heirs, executors, successors and permitted assigns;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->headings are for reference purposes only and must not be used in interpretation;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(h)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->where any word or phrase is given a defined meaning any other part of speech or other grammatical form concerning the word or phrase has a corresponding meaning;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(i)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->a reference to a statute includes all regulations and subordinate legislation and amendments;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(j)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->references to writing include any mode of representing or reproducing words in tangible and permanently visible form, and includes e-mail and fax;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(k)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->a reference to a monetary amount is a reference to an Australian currency amount;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(l)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->an obligation of two or more parties binds them jointly and each of them severally;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(m)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->an obligation incurred in favour of two or more parties is enforceable by them severally;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(n)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->references to time are to local time in Queensland;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(o)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->where time is to be reckoned from a day or event, the day or the day of the event must be excluded;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(p)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->a reference to a business day means any day on which trading banks are open for business in Queensland;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(q)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->if any time period specified in these Terms and Conditions expires on a day which is not a business day, the period shall expire at the end of the next business day;</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(r)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->a reference to a month means a calendar month; and</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(s)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->a reference to data includes metadata.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\">&nbsp;<strong>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>VOUCHER PROGRAM</strong></span></p>\r\n<p class=\"MLNumber1\"><span style=\"font-size: x-small;\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The Merchant will list its Vouchers for sale through the Website, and will control the Maximum Number of Vouchers to be sold through the Website. The Merchant warrants that it actually has the goods or services referred to in the Voucher for sale on the terms contained in the Fine Print.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->The Merchant is only entitled to sell the Maximum Number of Deals per month.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Yesthanks is authorized to promote and sell Vouchers on Merchant\'s behalf subject to the terms of these Terms and Conditions. The Voucher will evidence the Merchant Offering and will be sent to the purchaser electronically once payment is received. The purchaser will then redeem the Voucher with the Merchant by presenting the Voucher in paper or electronic form. Merchant is the issuer of the Vouchers and seller of the Merchant Offering.</span></p>\r\n<p class=\"MLNumber3\"><span style=\"font-size: x-small;\"><!--[if !supportLists]-->(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Yesthanks is authorized to promote and sell Vouchers on Merchant\'s behalf through any platform, including its feature deal-of-the-day, affiliates, business partner network, marketplace, or referral network. The Vouchers may be offered to all or part of Yesthanks\' subscriber base or its affiliate subscriber base or referral network and segmented by various variables including gender, age, location, and consumer preferences.</span></p>\r\n<p