n<p class=\"MLNumber2\">15.11&nbsp;&nbsp;&nbsp; Should a dispute arise in connection with these Terms of Service or with your use of the Site which cannot be resolved by good faith negotiations between us and you, Yesthanks may at its sole discretion refer the dispute to mediation or to arbitration. At all times we reserve the right to instigate legal proceedings prior to negotiation, arbitration or mediation against any person including any individual or entity (incorporated or otherwise)), who in our opinion has acted in breach of these Terms of Service.&nbsp;</p>\r\n</div>','2015-07-14 07:13:19','2016-03-05 12:42:03',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(9,'Terms','two_columns_right',NULL,NULL,'terms',NULL,'<p style=\"text-align: left;\" align=\"center\"><span style=\"text-decoration: underline;\"><span style=\"font-size: medium;\"><strong>PLEASE READ - BEFORE GETTING STARTED</strong></span></span></p>\r\n<p>A few quick rules to ensure both the Merchant and Customer have an enjoyable Yesthanks experience. (These rules are also covered in our Terms and Conditions): -</p>\r\n<ul>\r\n<li>Do not post any profanity</li>\r\n<li>Do not post any nudity whatsoever</li>\r\n<li>Do not make false or misleading posts</li>\r\n<li>Choose only the single relevant category</li>\r\n<li>Please post ads in English. If your target audience speaks another language then please post both in English and the required language</li>\r\n<li>No international posts allowed as Yesthanks is for Australian businesses only</li>\r\n<li>Do not discriminate towards race, sex, religion etc</li>\r\n<li>And anything else prohibited by Australian Law</li>\r\n</ul>\r\n<p>Any of these abuses of the site may result in criminal prosecution and you may at Yesthanks discretion be removed from the site without warning.</p>\r\n<p>If you have any questions regarding the above or you see anyone breaking these rules please contact - admin@yesthanks.com.au</p>\r\n<p>We at Yesthanks know that all of you fantastic Business owners and or employees that have signed up to this service would never abuse our trust and we look forward to building a wonderful business partnership with you all.</p>\r\n<p>&nbsp;</p>\r\n<p>Best Regards</p>\r\n<p>The Yesthanks Team!</p>\r\n<p class=\"MLHeadingTitle\">&nbsp;</p>\r\n<p class=\"MLHeadingTitle\">MERCHANT TERMS AND CONDITIONS</p>\r\n<p class=\"MLBodyText\">These Merchant Terms and Conditions (the &ldquo;Terms and Conditions&rdquo;) govern the arrangement between Yesthanks Pty Ltd (\"<strong>Yesthanks</strong>\") and the Merchant. Yesthanks may amend these Terms and Conditions in its sole discretion and at any time. The most recent version of the Terms and Conditions (as may be amended by Yesthanks from time to time) will be published on Yesthanks.com.au (\"<strong>Website</strong>\").</p>\r\n<p class=\"MLNumber1\"><!--[if !supportLists]--><strong>1.<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></strong><!--[endif]--><strong>DEFINITIONS</strong></p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(a)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Deal\" </strong>means a deal offered in a Voucher.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(b)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Fine Print\"</strong>&nbsp;means the conditions and restrictions concerning Voucher redemption and the Merchant Offering stated on the Website and Voucher.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(c)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Intellectual Property&rdquo;</strong> means all intellectual property rights, including without limitation inventions, patents, copyright, rights in circuit layouts, registered designs, trademarks, know-how, processes, concepts, intellectual property in name \"Yesthanks\", the Website, the system developed by Yesthanks and used on the Website and the source code for that system, and any right to have Information kept confidential and any application or right to apply for registration of any of the these rights throughout the world whether registered or unregistered and whether developed before or after the date of these Terms and Conditions.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(d)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Loss\"</strong> means any direct, indirect, special or consequential loss, damages, cost, expense, penalty, liability, charge or tax of any nature whatsoever, including loss of profit, opportunity, goodwill, business, production or stolen information, programs or other data (however arising or caused, including, without limitation, negligence).</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(e)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Maximum Number of Deals\" </strong>means the number of Deals the Merchant may provide in accordance with the terms of its Subscription.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(f)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Maximum Number of Vouchers\"</strong>&nbsp;means the maximum number of Vouchers Yesthanks is authorized to administer the sale of on behalf of the Merchant.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(g)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Merchant\"</strong> means a third party unrelated to Yesthanks that sells, supplies and/or provides the Merchant Offering. Yesthanks does not sell, supply and/or provide the Merchant Offering. It provides a platform by which the Merchant can sell and supply the Voucher.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(h)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Merchant Offering\"</strong>&nbsp;means the goods and/or services to be supplied and/or provided by the Merchant to the Voucher Holder, as specified on the Website and on the Voucher.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(i)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Payment\"</strong>&nbsp;means the amount a purchaser pays for each Voucher less any amount owed to Yesthanks by the Merchant from time to time.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(j)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Policy\"</strong> refers to any policy of Yesthanks in place from time to time including without limitation any policy relating to privacy, fees, refunds, feedback and service.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(k)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Promotional Value Expiration Date\"</strong>&nbsp;means the date stated on the Voucher when the Promotional Value expires.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(l)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Purchaser Information\"</strong> means any information relating to a purchaser of a Voucher.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(m)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Related Entity\"</strong>has the meaning given to it in section 9 of the <em>Corporations Act 2001</em> (Cth).</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(n)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Subscription\" </strong>means the subscription offer selected by the Merchant through the Website or as otherwise agreed between the parties, which entitles the Merchant to sell a certain number of Deals through the Website per month, being either bronze, silver or gold.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(o)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Subscription Fee\" </strong>means the monthly fee payable to Yesthanks by the Merchant which entitles the Merchant to list the number of Vouchers as agreed by the parties.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(p)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]--><strong>\"Voucher\"</strong> means an instrument, in either physical or electronic form, which entitles the holder of such Voucher (the \"<strong>Voucher Holder</strong>\") to receive the Merchant Offering from the Merchant during the period of time stated on the Voucher (the \"<strong>Redemption Period</strong>\").</p>\r\n<p class=\"MLNumber1\"><!--[if !supportLists]--><strong>2.<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></strong><!--[endif]--><strong>INTERPRETATION</strong></p>\r\n<p class=\"MLIndent1\">In these Terms and Conditions, unless inconsistent with the context or subject matter:</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(a)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->a reference to a person includes any other legal entity;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(b)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->a reference to a legal entity includes a person;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(c)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->words importing the singular number include the plural number;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(d)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->words importing the plural number include the singular number;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(e)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->the masculine gender must be read as also importing the feminine or neuter gender;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(f)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->a reference to a party includes the party\'s heirs, executors, successors and permitted assigns;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(g)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->headings are for reference purposes only and must not be used in interpretation;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(h)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->where any word or phrase is given a defined meaning any other part of speech or other grammatical form concerning the word or phrase has a corresponding meaning;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(i)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->a reference to a statute includes all regulations and subordinate legislation and amendments;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(j)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->references to writing include any mode of representing or reproducing words in tangible and permanently visible form, and includes e-mail and fax;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(k)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->a reference to a monetary amount is a reference to an Australian currency amount;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(l)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->an obligation of two or more parties binds them jointly and each of them severally;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(m)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->an obligation incurred in favour of two or more parties is enforceable by them severally;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(n)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->references to time are to local time in Queensland;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(o)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->where time is to be reckoned from a day or event, the day or the day of the event must be excluded;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(p)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->a reference to a business day means any day on which trading banks are open for business in Queensland;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(q)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->if any time period specified in these Terms and Conditions expires on a day which is not a business day, the period shall expire at the end of the next business day;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(r)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->a reference to a month means a calendar month; and</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(s)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->a reference to data includes metadata.</p>\r\n<p class=\"MLNumber1\"><!--[if !supportLists]--><strong>3.<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></strong><!--[endif]--><strong>VOUCHER PROGRAM</strong></p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(a)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->The Merchant will list its Vouchers for redemption through the Website, and will control the Maximum Number of Vouchers to be listed through the Website. The Merchant warrants that it actually has the goods or services referred to in the Voucher for sale on the terms contained in the Fine Print.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(b)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->The Merchant is only entitled to sell the Maximum Number of Deals per month.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(c)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Yesthanks is authorized to promote and sell Vouchers on Merchant\'s behalf subject to the terms of these Terms and Conditions. The Voucher will evidence the Merchant Offering and will be sent to the purchaser electronically once payment is received. The purchaser will then redeem the Voucher with the Merchant by presenting the Voucher in paper or electronic form. Merchant is the issuer of the Vouchers and seller of the Merchant Offering.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(d)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Yesthanks is authorized to promote and sell Vouchers on Merchant\'s behalf through any platform, including its feature deal-of-the-day, affiliates, business partner network, marketplace, or referral network. The Vouchers may be offered to all or part of Yesthanks\' subscriber base or its affiliate subscriber base or referral network and segmented by various variables including gender, age, location, and consumer preferences.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(e)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Yesthanks reserves the continuing right to reject, revise, or discontinue any Merchant Offering, at any time and for any reason in Yesthanks\' sole discretion, and to terminate the Merchant Offering and to remove all references to the Merchant Offering and Voucher from the Website; and redirect or delete any URL used in connection with the Merchant Offering.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(f)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Merchant shall honour the Vouchers for the Merchant Offering through the Promotional Value Expiration Date. After the Promotional Value Expiration Date, Merchant agrees to honour the Vouchers for at least the Amount Paid or for the Full Offer Value if required by law.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(g)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->If applicable, and if a customer redeems a Voucher for less than the Amount Paid, the Merchant is responsible for handling any unredeemed value as required by applicable law.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(h)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Merchant agrees that in providing the Merchant Offering, Merchant will not inflate prices or impose any additional fees, charges, conditions or restrictions that contradict or are inconsistent with the terms stated on the Voucher, including the Fine Print. Unless disclosed in the Fine Print, Merchant further agrees not to impose different terms or a different cancellation policy than what is imposed on its non-Yesthanks customers.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(i)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Merchant agrees that so long as an appointment or reservation is made to redeem a Voucher, or customer has made an attempt to make an appointment, before the Voucher\'s Promotional Value Expiration Date, the Voucher will be honoured for the Full Offer Value without restriction, even though the services may be provided after the Promotional Value Expiration Date.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(j)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Merchant is responsible for all customer service in connection with the Merchant Offering and for supplying all goods and services stated in the Merchant Offering. Merchant is also responsible for any customer loyalty programs associated with the Merchant Offering.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(k)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->If applicable, Merchant will hold the Merchant Offering for pick-up by each purchaser at the Redemption Site. The \"Redemption Site\" is the complete and accurate address provided by Merchant to Yesthanks where purchasers are able to redeem the Voucher to pick-up the Merchant Offering. Merchant also agrees to provide Yesthanks with the hours and dates of operation, complete with any exceptions, and a valid phone number for the Redemption Site. If any of the information related to a Redemption Site changes, Merchant agrees to notify Yesthanks immediately of such change by updating its details on the Website.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(l)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Merchant agrees to accept refunds and returns of the Merchant Offering in compliance with applicable laws and the Fine Print.</p>\r\n<p class=\"MLNumber1\"><!--[if !supportLists]--><strong>4.<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></strong><!--[endif]--><strong>PAYMENT</strong></p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(a)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->The Payment will be paid to the Merchant through Stripe (stripe.com/au) via a split payment gateway and will be reduced by any fees or charges payable to Stripe in respect of this service.&nbsp;</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(b)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->On creating an account with Yesthanks, the Merchant may be required to set up an account with Stripe as directed by Yesthanks.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(c)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->The Merchant is required to pay Yesthanks the Subscription Fee in accordance with the payment terms of that Subscription Fee, which will be monthly unless otherwise agreed by the parties.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(d)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->The parties acknowledge and agree that upon paying the Payment in respect of a Voucher, a contract is entered into between the Merchant and the purchaser, and the Payment is deemed to have been received directly by the Merchant. For the avoidance of doubt Yesthanks is not a party to this contract and is not responsible for the Payment in anyway whatsoever, including payment of taxes in respect of the Payment.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(e)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->For the avoidance of doubt the Subscription Fee and any other fees paid by the Merchant to Yesthanks is non-refundable to the extent permitted by law.</p>\r\n<p class=\"MLNumber1\"><!--[if !supportLists]--><strong>5.<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></strong><!--[endif]--><strong>MARKETING</strong></p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(a)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Yesthanks and its business partners may communicate with Merchant with regard to products, promotions, and other services that may be of interest to Merchant. This may include email or other communications.</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(b)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Yesthanks may also solicit Merchant&rsquo;s opinion and feedback for market resea