ia (now known or not known) or other entity as Yesthanks sees fit; and</p>\r\n<p class=\"MLNumber3\"><!--[if !supportLists]-->(i)<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Yesthanks is not liable or responsible for any Loss that the Merchant may experience in submitting its Information to Yesthanks or for Yesthanks\' use of the Merchant\'s Information (excluding Purchaser Information) in accordance with the licence granted.</p>\r\n<p class=\"MLNumber2\"><a name=\"_Toc404411323\"></a><!--[if !supportLists]-->9.2<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Yesthanks in its sole, absolute and unfettered discretion may refuse or remove any Information from the Website.</p>\r\n<p class=\"MLNumber1\"><!--[if !supportLists]--><strong>10.<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></strong><!--[endif]--><strong>NON-EXCLUSIVITY<a name=\"_Toc404411324\"></a><a name=\"_Toc395104261\"></a></strong></p>\r\n<p class=\"MLIndent1\"><a name=\"_Toc404411325\"></a>Yesthanks may enter into agreements with other Merchants on terms the same or different to these Terms and Conditions and the Merchant will not be entitled to make any objection or claim.</p>\r\n<p class=\"MLNumber1\"><a name=\"_Ref404702647\"></a><a name=\"_Toc404411329\"></a><!--[if !supportLists]--><strong>11.<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></strong><!--[endif]--><strong>NO WARRANTY AND DISCLAIMERS</strong></p>\r\n<p class=\"MLNumber2\"><a name=\"_Toc404411330\"></a><!--[if !supportLists]-->11.1<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[endif]-->Yesthanks provides the Website and Yesthanks Services on an &ldquo;as is&rdquo; basis and to the extent permitted by law Yesthanks specifically disclaims and contracts out of any implied warranties.</p>\r\n<p class=\"MLNumber2\"><a name=\"_Toc404411332\"></a><!--[if !supportLists]-->11.2<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><!--[