a platform through the form of the Site by which Users can purchase Vouchers.</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p class=\"MLNumber3\">(n)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Site\"&nbsp;</strong>means&nbsp;<a href=\"http://www.yesthanks.com.au/\">www.Yesthanks.com.au</a>&nbsp;and its mobile applications, electronic communications or services, or any location at which you can purchase a Voucher from Yesthanks.</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p class=\"MLNumber3\">(o)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Voucher\"</strong>&nbsp;means an instrument, in either physical or electronic form, which entitles the holder of such Voucher (the \"<strong>Voucher Holder</strong>\") to receive the Merchant Offering from the Merchant during the period of time stated on the Voucher (the \"<strong>Redemption Period</strong>\").</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p class=\"MLNumber3\">(p)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>\"Yesthanks\"</strong>&nbsp;means&nbsp;Yesthanks Pty Ltd</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p class=\"MLNumber3\">(q)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>&ldquo;User&rdquo;&nbsp;</strong>means any person who uses the Site for any purpose whatsoever.</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p class=\"MLNumber3\">(r)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>&ldquo;you&rdquo;</strong>&nbsp;and&nbsp;<strong>&ldquo;your&rdquo;&nbsp;</strong>means a User, Purchaser or Merchant (as the case may be).</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p class=\"MLNumber3\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p class=\"MLNumber2\">1.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Interpretation</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nb