aws, rules and regulations, and the inherent hazards of electronic communication, there may be delays, omissions or inaccuracies in Yesthanks Information.</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p class=\"MLNumber2\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<ol>\r\n<li>Purchase Of A Voucher</li>\r\n</ol>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<div>&nbsp;</div>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p class=\"MLNumber2\">5.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You must be at least 18 years old to purchase a Voucher. Before you can make a purchase you may need to register and create an account with Yesthanks, as determined by Yesthanks from time to time.</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p class=\"MLNumber2\">5.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; By clicking on the \"Buy Now\" or other similar button you submit an offer to Yesthanks to buy the Voucher. However, the purchase of the Voucher is not complete until you receive an email from Yesthanks confirming acceptance of your offer. Yesthanks expressly reserves the right to reject your offer. In addition, even if Yesthanks has accepted your offer, it can cancel the contract at any time if it reasonably suspects that you have committed or that you may be committing any fraud against Yesthanks, an affiliated third party of Yesthanks or the Merchant.</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p class=\"MLNumber2\">5.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The Merchant may have its own terms and conditions applicable to the sale, supply and/or provision of the Merchant Offering.</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<ol>\r\n<li>Redemption Of A Voucher</li>\r\n</ol>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p class=\"MLNumber2\">6.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Unless expressly stated otherwise:</p>\r