ite which cannot be resolved by good faith negotiations between us and you, Yesthanks may at its sole discretion refer the dispute to mediation or to arbitration. At all times we reserve the right to instigate legal proceedings prior to negotiation, arbitration or mediation against any person including any individual or entity (incorporated or otherwise)), who in our opinion has acted in breach of these Terms of Service.&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px;\"><strong><span style=\"padding: 0px; margin: 0px; text-decoration: underline;\"><span style=\"font-size: medium; padding: 0px; margin: 0px;\"><br /></span></span></strong></p>\r\n<p style=\"padding: 0px; margin: 0px;\"><strong><span style=\"padding: 0px; margin: 0px; text-decoration: underline;\"><span style=\"font-size: medium; padding: 0px; margin: 0px;\"><br style=\"padding: 0px; margin: 0px;\" /></span></span></strong></p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n</div>','2015-07-14 07:13:19','2016-01-23 01:38:38',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(13,'Privacy Policy','two_columns_right',NULL,NULL,'privacy',NULL,'<div id=\"business\">\r\n<div class=\"page-title\">\r\n<h1>Privacy Policy</h1>\r\n</div>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<p style=\"padding: 0px; margin: 0px;\">&nbsp;</p>\r\n<ol>\r\n<li>Overview</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">1.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; This privacy policy (Privacy Policy) sets out how Yesthanks collects, stores, uses, protects, shares and discloses your personal information. It applies to the Website and all related websites, applications, services and tools (together the Website). By visiting or using the Website you agree to the collection, storage, usage and disclosure of your personal information by Yesthanks in the manner described in this Privacy Policy.&nbsp;</p>\r\n<p class=\"MLNumber2NB\">1.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You agree, consent and acknowledge that we may in our sole discretion sell, disclose, license and/or rent your personal information to a third party for that third party&rsquo;s marketing or other purposes.</p>\r\n<p class=\"MLNumber2NB\">1.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We reserve the right to amend this Privacy Policy at any time by posting an updated version of this Privacy Policy on the Website.&nbsp; By continuing to use the Website after notice of changes has been published on the Website, you are deemed to have consented to the changes.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Definitions</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">2.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Unless otherwise defined, words defined in our Terms of Service have the same meaning in this Privacy Policy.</p>\r\n<p class=\"MLNumber2NB\">2.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In this Privacy Policy, we use the term &ldquo;personal information&rdquo; to describe information that can be associated with a specific person and can be used to identify that person and includes your Information. We do not consider personal information to include information that has been made anonymous or aggregated so that it cannot be used, whether in combination with other information or otherwise, to identify a specific User.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>How we collect personal information</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">3.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Yesthanks collects personal information in a number of ways, including:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; when you provide information directly to Yesthanks through the Website, in person, by phone or in writing (whether by email or any other electronic means, or otherwise);</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; when you visit and/or use the Website, in which case, Yesthanks records information sent to us by your computer, mobile device or other access device; and</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; from third parties such as Yesthanks&rsquo; Related Entities, service providers to Yesthanks, operators of linked websites, applications and advertising on the Website.&nbsp;</p>\r\n<p class=\"MLNumber2NB\">3.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In some circumstances, personal information is provided to us by third parties or other organisations conducting activities on your behalf.&nbsp; It is assumed that you have provided consent for your personal information to be used and disclosed to us this way.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>What we collect</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">4.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may collect the following types of personal information in order to provide the Services:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; your name, phone number, mobile telephone number, email address, and other contact information;&nbsp;</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; any information provided by you;&nbsp;</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; personal information based on your activities on the Website;</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; personal information you provide to us through any discussions boards, correspondence, member information pages, disputes, or shared by you from other social applications, services or websites;</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; to the extent permitted by law, other personal information provided by or obtained from third parties (such as a credit bureau) including navigation and demographic data and credit check information;</p>\r\n<p class=\"MLNumber3\">(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; additional personal information we ask you to provide to verify your identity or when we suspect that you are in breach of our Terms of Service, this Privacy Policy or other Website policies (including your personal ID and your answers to any questions we pose to you);</p>\r\n<p class=\"MLNumber3\">(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; personal information from your interaction with the Website and its content and advertising, including without limitation device identifiers, device type, geo-location information, connection information, statistics on page views, traffic to and from the Website, mobile network information, time, date, referring URL, the type of operating system and browser, ad data, IP address and standard web log data; and</p>\r\n<p class=\"MLNumber3\">(h)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; any other information we consider may assist us in marketing our services.</p>\r\n<p class=\"MLNumber2NB\">4.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We understand the importance of protecting children\'s privacy.&nbsp; The Website and any other related sites such as our Facebook, LinkedIn or other social media pages are not intentionally designed for or directed at children under the age of 13 years.&nbsp; It is our policy never to knowingly collect or maintain information about anyone under the age of 13.</p>\r\n<p class=\"MLNumber2NB\">4.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In the event you do not provide personal information that we request, we may not be able to provide the Services to you.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Automatic Collection of your Personal Information</li>\r\n</ol>