class=\"MLNumber3\">(m)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; collect fees, such as our information technology and introduction fee, resolve disputes and to identify, test and resolve problems;</p>\r\n<p class=\"MLNumber3\">(n)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; respond to or resolve claims that a User has violated the rights of others;</p>\r\n<p class=\"MLNumber3\">(o)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; enforce a contract or agreement which we have with a Legal Service Provider;</p>\r\n<p class=\"MLNumber3\">(p)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; notify you about the Website and updates to the Website from time to time;</p>\r\n<p class=\"MLNumber3\">(q)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; supply you with generalised, targeted or personalised marketing, advertising and promotional notices, offers and communications, and measure and improve our marketing, advertising and promotions based on your ad customisation preferences; or</p>\r\n<p class=\"MLNumber3\">(r)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; protect a person&rsquo;s rights, property or safety.</p>\r\n<p class=\"MLNumber2NB\">6.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; For the avoidance of doubt you consent to Yesthanks providing the Merchant selected by you through the Website with your personal information to enable them to provide you with the Merchant Offering.</p>\r\n<p class=\"MLNumber2NB\">6.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In the event we share your personal information to third parties in accordance with this clause you agree and acknowledge that Yesthanks does not control the use, storage or disclosure of that information by such third parties (nor their privacy policies if any), who may apply different privacy rules and practices. As a result, in the event you suffer a Loss as a result of the conduct of such third parties in relation to the handling of your personal information, you release and hold harmless Yesthanks (and its Related Entities, officers, directors, agents, employees and contractors) from actions, claims, demands and Losses of every kind and nature, known and unknown, suspected and unsuspected, disclosed and undisclosed, arising out of or in any way connected with such Loss.</p>\r\n<p class=\"MLNumber2NB\">6.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If you access the Website from a shared device or a device of a third party (such as in an internet caf&eacute;), your personal information may also be available to other persons who access that device.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Disclosure of personal information</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">7.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; By submitting data to us electronically, you are providing explicit consent to trans-border transmission of data collected via our website.</p>\r\n<p class=\"MLNumber2NB\">7.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may disclose your personal information to third parties for the purposes contained in clause 6, including without limitation to:</p>\r\n<p class=\"MLNumber3\">(a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; our staff members;</p>\r\n<p class=\"MLNumber3\">(b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Merchants;</p>\r\n<p class=\"MLNumber3\">(c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; contractors and outsourced service providers who manage the services we provide to you, including:-</p>\r\n<p class=\"MLNumber4\">(i)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; information technology service providers;</p>\r\n<p class=\"MLNumber4\">(ii)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; installation, maintenance and repair service providers;</p>\r\n<p class=\"MLNumber4\">(iii)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; market research organisations; and</p>\r\n<p class=\"MLNumber4\">(iv)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; debt-recovery agencies;</p>\r\n<p class=\"MLNumber3\">(d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; your authorised representatives;</p>\r\n<p class=\"MLNumber3\">(e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; third parties to whom you expressly ask us to send, or consent to us sending, your personal information;</p>\r\n<p class=\"MLNumber3\">(f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; our professional advisers, including our accountants, lawyers and auditors;</p>\r\n<p class=\"MLNumber3\">(g)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; government and regulatory authorities and other similar organisations, as required or authorised by law;</p>\r\n<p class=\"MLNumber3\">(h)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; our Related Entities; and</p>\r\n<p class=\"MLNumber3\">(i)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; such entities that we propose to merge with or be acquired by.</p>\r\n<p class=\"MLNumber3\">&nbsp;</p>\r\n<ol>\r\n<li>Other Publications</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">8.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Yesthanks may enable Users to publish comments on certain parts of the Website. If you comment on a publication on the Website, then those comments, including any personal information provided by you or a third party (including your name) may be available and visible to Users.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Use of Cookies</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">9.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We (or a third party providing services to Yesthanks) may use cookies, pixel tags, \"flash cookies&rdquo;, or other local storage provided by your browser or associated applications (each a Cookie and together Cookies). A Cookie is a small file that may be placed on your computer when you visit the Website. Cookies are used on some parts of the Website. Most browsers now recognise when a cookie is offered and permit you to refuse or accept it. If you are not sure whether your browser has this capability, you should check with the software manufacturer, your company\'s technology help desk or your internet service provider. If Cookies are disabled, Yesthanks may not be able to provide you with the full range of Yesthanks\'Services.</p>\r\n<p class=\"MLNumber2NB\">9.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cookies may collect and store your personal information. This Privacy Policy applies to personal information collected via Cookies. You consent and acknowledge that we collect your personal information through Cookies.</p>\r\n<p class=\"MLNumber2NB\">9.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cookies may be used to provide you with the Services, including to identify you as a User of the Website, remember your preferences, customise and measure the effectiveness of the Website and our promotions, advertising and marketing, analyse your usage of the Website, and for security purposes.</p>\r\n<p class=\"MLNumber2NB\">9.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You also may encounter Cookies used by third parties and placed on certain pages of the Website that we do not control and have not authorised (such as webpages created by another User). Yesthanks is neither responsible nor liable for the use of such Cookies.</p>\r\n<p class=\"MLNumber2NB\">9.5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The Website may also include links to third party websites (including links created by users or members) and applications and advertising delivered to the Website by third parties (Linked Sites). Organisations who operate Linked Sites may collect personal information including through the use of Cookies. Yesthanks is not responsible nor liable for Linked Sites and recommends that you read the privacy policies of such Linked Sites before disclosing your personal information. For the avoidance of doubt Linked Sites are not subject to this Privacy Policy.</p>\r\n<p class=\"MLNumber2NB\">9.6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The Website is hosted by an online service provider which may change from time to time.&nbsp; Our service providers\' use of Cookies is not covered by our Privacy Policy.</p>\r\n<p class=\"MLNumber2NB\">9.7&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We reserve the right to collect more extensive information about any attempted access to our Website that raises security issues and make the appropriate disclosures to the relevant authorities.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>No Spam, Spyware or Spoofing</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">10.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You are prohibited from engaging in spam, spyware or spoofing type activities, regardless of whether directed towards Yesthanks or other users of Yesthanks.</p>\r\n<p class=\"MLNumber2NB\">10.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You must not use the Website or anything related to the Website such as emails, to send, upload or distribute spam, viruses or malicious, illegal or prohibited content to the Website or otherwise send content that would breach our Terms of Service or this Privacy Policy.</p>\r\n<p class=\"MLNumber2NB\">10.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may (or we may engage a third party service provider to) take steps to scan and filter messages to check for spam, viruses, phishing attacks and other malicious activity or unlawful or content prohibited by this Privacy Policy and our Terms of Service.</p>\r\n<p class=\"MLNumber2NB\">10.4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To report spam, spyware or spoof activities to Yesthanks, email us at admin@Yesthanks.com.au&nbsp;</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Storage and security</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">11.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We store and process your personal information on our host&rsquo;s servers, currently located in multiple locations around the world. You consent to the transfer, storage and retention of that information onto the servers of our host provider used from time to time by Yesthanks, regardless of the location of those servers.&nbsp;</p>\r\n<p class=\"MLNumber2NB\">11.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Yesthanks has taken reasonable steps to protect your personal information. These measures are designed to mitigate, but do not guarantee against, the risk of loss, misuse, unauthorised access, disclosure and alteration.</p>\r\n<p class=\"MLNumber2NB\">11.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; To the extent permitted by law, we reserve the right to retain and store your personal information for such period as is deemed necessary by Yesthanks in its sole discretion. If we determine that we no longer need to hold your personal information, we will take reasonable steps to destroy or permanently de-identify that information.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Information Sharing with Social Websites</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">12.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; We may offer services that allow you to share public aspects of the Website with third party websites such as Google Plus, Twitter, LinkedIn, Facebook and others social media websites.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Access to information</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">13.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You may request to access the personal information we hold about you. All requests for access will be processed within a reasonable time.&nbsp;</p>\r\n<p class=\"MLNumber2NB\">13.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; In certain instances we may not be required or able to provide you with access to your personal information.&nbsp; If this occurs we will give you reasons for our decision not to provide you with such access to your personal information.</p>\r\n<p class=\"MLNumber2NB\">13.3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; There is no application fee for making a request to access your personal information.&nbsp; However, we may charge an administrative fee for the provision of information in certain circumstances such as if you make repeated requests for information or where the information is held by a third party provider.</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Opting out</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">14.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; You may opt out of receiving our marketing, advertising and promotional notices, offers and communications by communicating this to us by email to admin@Yesthanks.com.au</p>\r\n<p class=\"MLNumber2NB\">&nbsp;</p>\r\n<ol>\r\n<li>Contact Us</li>\r\n</ol>\r\n<div>&nbsp;</div>\r\n<p class=\"MLNumber2NB\">15.1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If you receive communications purporting to be connected with us or our services that you believe have been sent to you other than in accordance with this Privacy Policy, or in breach of any law, please contact us by email to admin@yesthanks.com.au</p>\r\n<p class=\"MLNumber2NB\">15.2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; If you have a question regarding this Privacy Policy or you would like to make a complaint, please contact our Privacy Officer by email at: admin@yesthanks.com.au</p>\r\n<p>&nbsp;</p>\r\n</div>','2015-07-14 07:13:19','2016-01-23 02:16:06',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(14,'Press','two_columns_right',NULL,NULL,'press',NULL,'<div id=\"business\">\r\n<div class=\"page-title\">\r\n<h1>Press</h1>\r\n</div>\r\n<p style=\"padding: 0px; margin: 0px;\"><span style=\"font-size: x-small;\"><span style=\"font-size: medium;\"><strong><span style=\"text-decoration: underline;\"><br /></span></strong></span></span></p>\r\n<p style=\"padding: 0px; margin: 0px;\"><span style=\"text-decoration: underline;\">November 2015</span></p>\r\n<p>I am excited to announce after many years of planning and mon<span class=\"text_exposed_show\">ths of designing that one of the most advanced and innovative group marketing/deals platforms &ldquo;yesthanks.com.au&rdquo; is about to be launched here locally in the New Year.</span></p>\r\n<p><span class=\"text_exposed_show\"><br /></span></p>\r\n<div class=\"text_exposed_show\">\r\n<p>&ldquo;Yes Thanks&rdquo; will be the first of its kind in the region, combining the most effective marketing strategies and tools, such as our very own special deals website and both an iPhone and Android App for maximum exposure and ease of use.</p>\r\n<p>&nbsp;</p>\r\n<p>The core purpose of the &ldquo;Yes Thanks&rdquo; Platform is to partner side by side with local business&rsquo;s and offer an affordable yet super effective group marketing/buying platform without the expense of typical marketing channels or exorbitant revenue sharing costs preferred by similar sites. We will generate maximum traffic through targeted advertising and brand exposure to ensure your business will have the opportunity to be seen by everyone looking to purchase goods or services in the local area. Our AIM in fact is to transform one off customers into repeat buyers whilst also turning those not intending to buy into repeat customers as well. \"Yes Thanks\" will be a must have for everybody and will be the go to App or Website for many daily needs or activities.</p>\r\n<p>&nbsp;</p>\r\n<p>&ldquo;Yes Thanks&rdquo; will be a group marketing/buying platform with many benefits, offered through a simple monthly subscription. It will assist businesses by not only attracting many and new customers but by also allowing those business&rsquo;s to keep all revenue generated through the advertised deals.</p>\r\n<p>&nbsp;</p>\r\n<p>Plans starting from only $49.95 per month will be offered, making it an extremely affordable option for each and every business. (SPECIAL! for a limited time we will be offering the first 100 members a special Locals only Foundation Membership for an amazing 50% off all plans! Strictly 100 Local Members only!)</p>\r\n<p>&nbsp;</p>\r\n<p>The concept is proven and very effective. Similar sites such as Groupon and Scoopon have benefited many businesses throughout the major cities in recent years but focus more on the deal and savings for the customer then the marketing and cost for the business. &ldquo;Yes Thanks&rdquo; will focus more on marketing and increasing the revenue for the business instead but will also in turn benefit the Customer through offering amazing deals. It will be a Win - Win for both the Business &amp; Customer alike!</p>\r\n<p>&nbsp;</p>\r\n<p>&ldquo;Yes Thanks&rdquo; will be similar in design to the above mentioned and respected Company&rsquo;s but also very different, with many added features. It will also cater for local and regional business&rsquo;s unlike Groupon and Scoopon...</p>\r\n<p>&nbsp;</p>\r\n<p>For those of you that know me, know how passionately I feel towards helping people with any personal struggles they may be facing and want to overcome in their life or helping them with any personal development goals they may be striving to achieve. I am fortunate enough to be able to do this through both the Local Emu Park Boxing Club that I have run for more than 10 years and through Trance Formation Academy that a good friend and I founded with the sole purpose of helping people with their Health &amp; Well being goals. I feel the same passion when I think about how I can help work with local businesses in the area to achieve their same desired goals also.</p>\r\n<p>&nbsp;</p>\r\n<p>Start next year on the right foot - A must for any serious business in New Year</p>\r\n<p>&nbsp;</p>\r\n<p>Further details will be provided as the exciting Launch nears!</p>\r\n<p>&nbsp;</p>\r\n<p>I look forward to partnering with and helping every local business in the area with their marketing and growth success in 2016 and beyond!</p>\r\n<p>&nbsp;</p>\r\n<p>To register your interest please email or text your business details to my contact information below.</p>\r\n<p>&nbsp;</p>\r\n<p>Founder &amp; Proud Local</p>\r\n<p>Aaron Solito<br />Email: asolito@hotmail.com<br />Phone: 0400 462 676</p>\r\n</div>\r\n</div>','2015-07-14 07:13:19','2016-01-22 23:49:05',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(15,'Maintenance Page','two_columns_right','Maintenance Page','Maintenance Page','maintenancepage.html',NULL,'<h3 style=\"text-align: center;\"><span style=\"color: #000000; font-family: \'times new roman\', times; font-size: x-large; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; float: none; display: inline !important; background-color: #ffffff;\">Sorry For The Inconvenience</span></h3>\r\n<p><span style=\"color: #000000; font-family: times new roman,times; font-size: large; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; display: inline ! important; float: none; background-color: #ffffff;\"><br /></span></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #000000; font-family: \'times new roman\', times; font-size: large; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; float: none; display: inline !important; background-color: #ffffff;\">We are still in the process of building this website so please return to the \"Deal\" you are interested in and follow the directions to redeem the \"Offer\" directly from the Business Owner. Thank you for your understanding.</span></p>\r\n<p style=\"text-align: center;\"><span style=\"color: #000000; font-family: \'times new roman\', times; font-size: large; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21px; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; float: none; display: inline !important; background-color: #ffffff;\"><br /></span></p>','2016-01-20 04:58:46','2016-01-28 06:06:54',1,0,NULL,'default/grey_theme','two_columns_right',NULL,NULL,NULL);
